INSERT INTO `phpbb_forums` VALUES (32, 10, 'Güzel Sözler', '<p align="center"><script language="JavaScript1.1" type="text/javascript"> \r\n<!-- \r\nquotes = new Array (11); \r\nquotes[0] = "Eline, diline, beline sahip ol ki, kötülükler senden uzak dursun."; \r\nquotes[1] = "Musibet zekay&#305; e&#287;itir."; \r\nquotes[2] = "Ki&#351;inin s?z?, amelinden ?ok olursa akl&#305; noksand&#305;r."; \r\nquotes[3] = "Ne kadar okursan oku, bilgine yak&#305;&#351;&#305;r &#351;ekilde davranmazsan cahilsin demektir.(Sadi)"; \r\nquotes[4] = "Tek dostum kitaplar&#305;m, tek d?&#351;man&#305;m cahil dostlar&#305;m. (Diderot)"; \r\nquotes[5] = "Felaketler, ayak seslerini duymayanlara geliyorum demez."; \r\nquotes[6] = "Harekette birlik olmazsa, fikirde bilgi faydas&#305;zd&#305;r. (Muhammed ikbal)"; \r\nquotes[7] = "Zalime, ancak, onu zul?mden al&#305;koymak i?in yard&#305;m et."; \r\nquotes[8] = "Yar&#305;n, yorgun kimselerin de&#287;il, rahatlar&#305;na k&#305;yabilenlerindir. (N. Atac)"; \r\nquotes[9] = "Kuvvetine g?venenler, korkutma k???kl?&#287;?nde bulunmazlar. (Abdulhamid Han)"; \r\nquotes[10] = "Tarihte her hareket hep bir ki&#351;inin aya&#287;a kalkmas&#305;yla ba&#351;lar."; \r\nquotes[11] = "Kesilmis koyuna, derisini y?z?lmesi elem vermez."; \r\nquotes[12] = "Kendini hak ile me&#351;gul etmezsen, bat&#305;l seni i&#351;gal eder. (&#304;mam &#350;afi)"; \r\nquotes[13] = "Her&#351;eyi bilmek ?ok k?t?d?r."; \r\nquotes[14] = "Allah''a itaat etmekle, O''na &#351;?kretmi&#351; olursunuz."; \r\nquotes[15] = "Ak&#305;ll&#305; olan Allah''tan korkar."; \r\nquotes[16] = "&#304;limsiz ibadette, tefekk?rs?z Kur''an tilavetinde hay&#305;r yoktur. (Hz. Ali r.a.)"; \r\nquotes[17] = "Allah''tan korkmayandan korkulur."; \r\nquotes[18] = "El a&#287;az&#305;na bakan kar&#305;s&#305;n&#305; tez bo&#351;ar."; \r\nquotes[19] = "Gercek dost, arkada&#351;&#305;n&#305;n kusurunu g?r?nce onu uyar&#305;r. Fakat bu kusurlar&#305; ba&#351;kalar&#305;na a?&#305;klamaz. (&#304;mam &#350;afi)"; \r\nquotes[20] = "&#350;ahsi gayret yuvayi, toplu gayret vatani ayakta tutar. (A. Aslan)"; \r\nquotes[21] = "K???k insanlar&#305;n gururu b?y?k olur."; \r\nquotes[22] = "Kitap akl&#305;n ilac&#305;d&#305;r."; \r\nquotes[23] = "Dost ac&#305; s?yler."; \r\nquotes[24] = "Karde&#351; karde&#351;i atm&#305;&#351;, yar ba&#351;&#305;nda tutmu&#351;."; \r\nquotes[25] = "Islanm&#305;&#351;&#305;n ya&#287;murdan korkusu olmaz."; \r\nquotes[26] = "Dost a&#287;lat&#305;r, d?&#351;man g?ld?r?r."; \r\nquotes[27] = "Ecel geldi c&#305;hane, ba&#351;a&#287;r&#305;s&#305; bahane."; \r\nquotes[28] = "&#304;slamiyeti ya&#351;ayan kimse, hem &#351;ahsi, hem ailevi ve hem de sosyal hayat&#305;nda ibadet ediyor demektir. (Hekimo&#287;lu &#304;smail)"; \r\nquotes[29] = "Gen?li&#287;ine g?venme, ?len hep ihtiyarm&#305; ?"; \r\nquotes[30] = "&#304;nsan ne kadar y?kselirse, g?nl? o kadar al?almal&#305;d&#305;r."; \r\nquotes[31] = "Tecr?be bilgiyi art&#305;r&#305;r. Her &#351;eye inanmak ise insan&#305; yan&#305;lt&#305;r."; \r\nquotes[32] = "K???k ta&#351;, ba&#351; yarar."; \r\nquotes[33] = "Haramdan uzak dur, ama mahremini g?zet."; \r\nquotes[34] = "Nimetlerin en iyisi ?al&#305;&#351;arak kazan&#305;lan, arkada&#351;lar&#305; en iyisi de Allah''&#305; hat&#305;rlatand&#305;r."; \r\nquotes[35] = "Bir kimseyi tan&#305;mak istiyorsan, arkada&#351;&#305;na bak. (Mevlana)"; \r\nquotes[36] = "El ?pmekle dudak a&#351;&#305;nmaz."; \r\nquotes[37] = "Ahmakl&#305;k, hatada israr etmektedir. (Abdulhakim Arvas&#305;)"; \r\nquotes[38] = "Nasihat tutmayan&#305; musibet tutar."; \r\nquotes[39] = "Herkesi kendi gibi sanan aldan&#305;r."; \r\nquotes[40] = "Yerinde s?z s?ylemesini bilen, ?z?r dilemek zorunda kalmaz. (Fatih Sultan Mehmed)"; \r\nquotes[41] = "?z? do&#287;ru olan&#305;n s?z? de do&#287;ru olur. (Hz. Ali (r.a.))"; \r\nquotes[42] = "K???k bir delik, b?y?k bir gemiyi bat&#305;r&#305;r."; \r\nquotes[43] = "(Siz''de g?zel bir s?z biliyorsan&#305;z bana yaz&#305;n)"; \r\nquotes[44] = "Do&#287;ru sars&#305;l&#305;r, ama y&#305;k&#305;lmaz."; \r\nquotes[45] = "Adaletin bulunmad&#305;&#287;&#305; bir ?lkede herkez su?ludur."; \r\nquotes[46] = "Zeka, kafan&#305;n i?indeki alt&#305;n madenidir."; \r\nquotes[47] = "&#304;teatsizlik &#351;erlerin en k?t?s?d?r."; \r\nquotes[48] = "&#304;nsan idare etme sanat&#305;na siyaset denir."; \r\nquotes[49] = "Kimsenin zenginli&#287;i seni de&#287;erlendirmez."; \r\nquotes[50] = "Fakir ki&#351;i, cimrilik yapan ki&#351;idir."; \r\nquotes[51] = "Zengin ki&#351;i iktisad&#305; bilen ki&#351;idir."; \r\nquotes[52] = "Zengin, kalbi zengin olan ki&#351;idir."; \r\nquotes[53] = "?ok dinlememiz ve az konu&#351;mam&#305;z i?in, iki kula&#287;&#305;m&#305;z ve bir dilimiz vard&#305;r."; \r\nquotes[54] = "M?min, sonu cennet oluncaya kadar, hi?bir hay&#305;rdan doymaz, geri kalmaz."; \r\nquotes[55] = "Da&#287;a ?&#305;kan d?z aramaz."; \r\nquotes[56] = "Adam&#305;n aynas&#305; arkada&#351;&#305;d&#305;r."; \r\nquotes[57] = "Zihin ar&#305;, kitap ?i?ektir."; \r\nquotes[58] = "Dan&#305;&#351;an da&#287;&#305; a&#351;m&#305;&#351;, dan&#305;&#351;mayan d?z yolda &#351;a&#351;m&#305;&#351;."; \r\nquotes[59] = "Korkak dostun olaca&#287;&#305;na, cesur dostun olsun."; \r\nquotes[60] = "Dostlar&#305;n&#305; terkeden terkedilir."; \r\nquotes[61] = "?zl? konu&#351;man&#305;n yolu, yersiz s?zleri b&#305;rakmakt&#305;r."; \r\nquotes[62] = "Destursuz ba&#287;a giren, hesaps&#305;z dayak yer."; \r\nquotes[63] = "&#304;nsan, d?&#351;ece&#287;i yere ?&#305;kmamal&#305;d&#305;r."; \r\nquotes[64] = "Kitap, donuk hayata renk katar."; \r\nquotes[65] = "&#304;yili&#287;e iyilik her ki&#351;inin kar&#305;, k?t?l?&#287;e iyilik ER ki&#351;inin kar&#305;."; \r\nquotes[66] = "G?z? haramdan korumak ne g?zel &#351;ehvet perdesidir. (Hz. Osman)"; \r\nquotes[67] = "Dilencinin keyfi i&#351;lek caddede gelir."; \r\nquotes[68] = "Yanli&#351;, iktidar&#305; artmakla hi?bir zaman do&#287;ru hale gelmez."; \r\nquotes[69] = "&#304;nsanlara ate&#351;e dost oldu&#287;un gibi dost ol. Ondan faydalan. Fakat seni yakmas&#305;ndan sak&#305;n."; \r\nquotes[70] = "Kovandan ?ikmayan ar&#305; bal yapmaz."; \r\nquotes[71] = "D?nyada zulme u&#287;rayanlar, kiyamette mutlaka kurtulu&#351;a ula&#351;acaklard&#305;r. (Hz.Muhammed sav.)"; \r\nquotes[72] = "Ancak i?inden ayd&#305;nlanan, d&#305;&#351;&#305;na &#305;&#351;&#305;k verir. (&#304;smet ?zel)"; \r\nquotes[73] = "Adam adama y?k de&#287;il, can g?vdeye m?lk de&#287;il."; \r\nquotes[74] = "Bize de&#287;er kazand&#305;ran &#351;eyler, yapt&#305;&#287;&#305;m&#305;z i&#351;lerdir."; \r\nquotes[75] = "Bir m?naf&#305;k, bir orduyu bozar."; \r\nquotes[76] = "Ac&#305;yan ?ok ama ekmek veren az."; \r\nquotes[77] = "&#304;nsanlar&#305;n &#351;ahsiyetlerini, iktidarl&#305; zamanlar&#305;nda ?l?melidir."; \r\nquotes[78] = "&#304;nsan&#305;n s?z? hikmet, bak&#305;&#351;&#305; ibret ve susmas&#305; ders olmal&#305;d&#305;r."; \r\nquotes[79] = "Alimler &#304;slam&#305;n bayraktar&#305;, cennetin sakinleridir."; \r\nquotes[80] = "Her deli&#287;e elini sokma, ya y&#305;lan ?&#305;kar ya ciyan."; \r\nquotes[81] = "Tarih tekerr?rden ibarettir."; \r\nquotes[82] = "S?zlerin en g?zeli vahiydir."; \r\nquotes[83] = "Birlik olmayan yerde, dirlik olmaz."; \r\nquotes[84] = "S?kut kavgay&#305; keser, fitneyi ?nler."; \r\nquotes[85] = "&#304;ffet, g?zelli&#287;in zekat&#305;d&#305;r."; \r\nquotes[86] = "Hi? bir zafere ?i?ekli yollardan gidilmez."; \r\nquotes[87] = "Fitne asl&#305;nda uykudad&#305;r, Allah (cc) onu uyand&#305;ranlara lanet eder. (Hz.Muhammed sav.)"; \r\nquotes[88] = "Bedava sirke, baldan tatl&#305;d&#305;r."; \r\nquotes[89] = "Kalbin g&#305;das&#305; iman, akl&#305;n g&#305;das&#305; faydal&#305; ilimdir."; \r\nquotes[90] = "G?zya&#351;&#305;, kalp te olan ate&#351;e delildir."; \r\nquotes[91] = "Merhamet etmeyene merhamet edilmez."; \r\nquotes[92] = "Al&#305;&#351;m&#305;&#351;, kudurmu&#351;tan beterdir."; \r\nquotes[93] = "Ak&#305;ll&#305; insan t?m yumurtalar&#305;n&#305; ayn&#305; sepete koymaz."; \r\nquotes[94] = "Buldum bilemedim, bildim bulamad&#305;m."; \r\nquotes[95] = "?l?m? hat&#305;rlamak, h&#305;rs ate&#351;ini s?nd?r?r."; \r\nquotes[96] = "Ne mutlu! Akl&#305; i&#351;ine bekci, kendi s?z?n? kendi tenkitci olana."; \r\nquotes[97] = "Cahil, ya&#351;l&#305; dahi olsa k???kt?r, Alim, k???k de olsa b?y?kt?r."; \r\nquotes[98] = "Gen?likte vaktini ge?iren sefa ile, ihtiyarlikta ?mr?n? ge?irir cefa ile."; \r\nquotes[99] = "Hicretin en faziletlisi, Allah''&#305;n sevmedi&#287;i &#351;eyleri terk etmektir. (Hz.Muhammed sav)"; \r\n\r\n//calculate a random index \r\nindex = Math.floor(Math.random() * quotes.length); \r\n\r\n//display the quotation \r\ndocument.write("<hr><H3>G?n?n S?z?: <br> " + "\\"" + quotes[index] + "\\"\\n <\\/H3>") \r\ndocument.write("Herg?n G?zel bir S?z. <hr>"); \r\n\r\n// --> \r\n</script> </p> \r\n', 0, 20, 4, 1, 260, NULL, 0, 1, 1, 1, 1, 1, 1, 3, 3, 1, 1, 0);
