INSERT INTO `phpbb_posts_text` VALUES (15, 'cf1d94ef51', 'Sude Naz Bunu Senin &amp;#304;?in Yaz&amp;#305;yorum...!', 'Sude Bunu Senin &#304;?in Yaz&#305;yorum...! Msn Ni aL...! \r\n\r\nMsn niz Hacklendi Diye ?z?lmeNize Hi? Gerek yok. arkada&#351;lar e&#287;er kendi mailinizi iyi tan&#305;yorsan&#305;z Passport@css.one.microsoft.com (devaml&#305; bu maile g?nderin cevap yazarken bile) bu adrese Kendiniz Hakk&#305;nda a&#351;a&#287;&#305;daki bo&#351;luklar&#305; doldurarak bir mail at&#305;n, Konuya (subject) yazaca&#287;&#305;n&#305;z yaz&#305; fazla ?nemli de&#287;il. Sak&#305;n parantez i?indekileri yazmay&#305;n Ataca&#287;&#305;n&#305;z maili a&#351;a&#287;&#305;da verdim, doldurarak g?nderin. \r\n\r\nPostalCode (posta Kodu) : \r\nComments (Sorununuzu ingilizce yaz&#305;n) : \r\nCustomerName (Maile Kay&#305;tl&#305; olan Ad, Soyad) : \r\nCUBirthdate (Maile Kay&#305;tl&#305; olan Do&#287;um Tarihi) : \r\nBrowserVersion (Taray&#305;c&#305;n&#305;n versiyonu) : \r\nOperatingSystem (&#304;&#351;letim Sistemi) : \r\nErrorMessage (Al&#305;nan Hata Mesaj&#305;) : \r\nSignInAddress (?al&#305;nan Mail Adresiniz) : \r\nCountry (?lke) : \r\nFirstName (Ad) : \r\nLastName (Soyad) : \r\nRegion (Bulundu&#287;unuz &#304;l) : \r\nContact E-Mail (Size Ula&#351;abilecekleri E-Mail) : \r\n\r\n_____________________________________ \r\n\r\nDaha sonra size a&#351;a&#287;&#305;daki gibi bir E-mail Gelecek; \r\n\r\nHello XXXXX, \r\n\r\nThank you for writing to Microsoft .NET Passport Customer Support. \r\n\r\nI understand that you need assistance in signing in to your XXXXXXXXX@hotmail.com account, because you suspect that someone learned your password and secret question/answer. I can imagine how frustrating such issues can be. This is Aldrin and I look forward to providing you with assistance today. \r\n\r\nI recognize the importance of gaining access on your account. To help protect the privacy and security of our members we need your help confirming the profile information stored in your MSN account before we can reset your password. \r\n\r\n- First and Last Name (or any other name you think you have entered upon registration such as your nickname) \r\n- Your .NET Passport account (the account you are having difficulties with, [email]username@domain.com)[/email] \r\n- Date of birth (Month/Date/Year) \r\n- Country or Region \r\n- State \r\n- ZIP or Postal Code \r\n- Approximate date of last successful sign in \r\n- Approximate date of account registration \r\n- List as many former passwords you used with this account as far back as you can remember \r\n- List as many of your Folders as you can remember (inbox, trash, sent, etc.) \r\n- The name of your Internet Service Provider. If you access your account from outside your home (for example, from school or work) please include the name of the organization. \r\n- Your IP address. You may check it by going to http://www.whatismyip.com \r\n- List of Secret Questions and Answers historically associated with your account \r\n\r\nOnce we have this information, we can reset your password and send it via e-mail to the address from which you sent your request. \r\n\r\nWe look forward to hearing from you again. \r\n\r\nSincerely, \r\n\r\nAldrin \r\nMicrosoft .NET Passport Customer Support Representative \r\n\r\n____________________________________________________________ \r\n\r\nBu E-Mail?e kar&#351;&#305;l&#305;k siz de en yukar&#305;da yazd&#305;&#287;&#305;m maile &#351;unlar&#305; yaz&#305;n, bilgilerinize g?veniyorsan&#305;z; \r\n\r\nHello, Thank you for help e-mail... \r\nI will try to answer my profil; \r\n\r\n- First Name (Ad-Soyad): \r\n- Account (?al&#305;nan Mail): \r\n- Birthday (Do&#287;um Tarihiniz): \r\n- Country (?lke) : \r\n- State (il/&#304;l?e): \r\n- Postal Code (posta Kodu) : \r\n- Approximate date of last successful sign in (?al&#305;nan Maille Son Kez Yap&#305;lan Ba&#351;ar&#305;l&#305; Login Olma **Yakla&#351;&#305;k Tarih**) : \r\n- Approximate date of account registration (E-mail in kaydetti&#287;iniz tarih **Yakla&#351;&#305;k**) : \r\n\r\n- My used passwords (E-mail hesab&#305;n&#305; kaydetti&#287;inizden bug?ne kulland&#305;&#287;&#305;n&#305;z &#351;ifreler) : \r\n- List as many of your Folders as you can remember (inbox, trash, sent, etc.) (E-mail i?eri&#287;i hakk&#305;nda bilgi verin, g?nderilen, al&#305;nan, silinenler filan) : \r\n- My internet Service Provider (interneti nereden kullan&#305;yorsan&#305;z, mesela i&#351;yerinde mi yoksa evdemi filan, ismini de yaz&#305;n) : \r\n\r\n- My IP Adress (ip adresiniz; www.whatismyip.com den ?&#287;renebilirsiniz) : \r\n- My used Secret Questions and Answers (kay&#305;t tarihinden itibaren kullan&#305;lan gizli soru ve cevaplar&#305;) : \r\n\r\nThis is my profil , please send my password back. REGARS. \r\n\r\nAynen Bunlar&#305; Uygulad&#305;ktan Sonra Mail Tekrar Sizde Hadi Kolay Gelsin...!');
