INSERT INTO `phpbb_posts_text` VALUES (22, '8f66f4c157', 'Trojan...!', 'Evet v1.0''&#305;n ard&#305;ndan uzun s?redir beklenen %100 T?rk yap&#305;m&#305; casus yaz&#305;l&#305;m&#305;n&#305;n g?ncel versiyonu olan v2.0''&#305; Kalitemiz iLe \r\nsitemizden indirebilirsiniz.T?rkiyede ve d?nyada ?ok konu&#351;ulacak olan bu canavar casus''u ?ok be&#287;eneceksiniz! \r\n\r\nTurkojan v2.0 yeni nesil trojanlar aras&#305;na girebilecek bir kapasiteye sahip,geli&#351;tirilmi&#351; T?rkiye''nin ger?ek ilk ve tek T?RK yap&#305;m&#305; casus yaz&#305;l&#305;m&#305;d&#305;r.T?rkojan ?ok geli&#351;mi&#351; ?zelliklere sahiptir.&#304;nternet kafelerdeki bilgisayarlara ve a&#287; arkas&#305;ndaki bilgisayarlara bir problem ?&#305;karmadan girme ?zelli&#287;ine sahiptir.?zellikle Windows i&#351;letim sistemi i?in tasarlanm&#305;&#351; bu casus canavar, bu i&#351;letim sisteminin kendi i?indeki korumalar&#305;n&#305; ve g?venlik duvarlar&#305;n&#305; a&#351;abiliyor.Bununla birlikte PC ye y?klenmi&#351; baz&#305; antivir?slerin ?al&#305;&#351;mas&#305;n&#305; da durdurabiliyor.Bu y?zden antivir?slere yakalanm&#305;yor.Ayr&#305;ca trojanda keylogger ?zelli&#287;ide mevcuttur.. Kurban&#305;n bilgisayar&#305;ndak&#305; yaz&#305;&#351;malar&#305; g?r?&#351;meleri sizin email adresinize yollayabiliyor.Herg?n yollas&#305;n,iki g?nde bir yollas&#305;n gibi se?enekleri mevcuttur.. T?rkojan&#305; a?&#305;nca trojan bula&#351;m&#305;&#351; ki&#351;iler seni bulabiliyor... T?rkojan bula&#351;t&#305;ran casus,sistemi kendi bilgisayar&#305; gibi kullan&#305;labilecek kadar geni&#351; se?eneklere sahip.Program ayr&#305;ca sistemdeki t?m &#351;ifreleri toplay&#305;p size raporlayabilir,kurban&#305;n web cam''i ?zerinden g?r?nt? kaydedebilir,b?t?n bu ?zellikler ve ?ok daha fazlas&#305; Turkojan v2.0 ile sizlerin kullan&#305;m&#305;na sunulmu&#351;tur! \r\n\r\nKISA KULLANIM DETAYLARI : \r\n\r\nbu b?l?mde sizlere server editor le ilgili bilgiler vericem \r\nyanl&#305;z turkojan 2.0 &#305; kullanmak isteyen arkada&#351;lar bir uyar&#305; \r\nyapmak istiyorum. \r\nturkojan 2.0 her ne kadar trojan s&#305;n&#305;f&#305;nda olsada program&#305;n \r\n?zelikleri e&#287;itim ama?l&#305; ve kendinize ait uzaktaki bilgisayarlara \r\ng?venli &#351;ekilde ula&#351;abilmeniz i?in yap&#305;lm&#305;&#351;t&#305;r. \r\nnas&#305;l ve ne kadar g?venli oldu&#287;unu serveri olu&#351;turuken anlat&#305;cam. \r\nturkojan 2.0 &#305; k?t? ama?l&#305; kulan&#305;lmas&#305; ve sistemlere zarar vermesi \r\nprogram&#305; yapan ve anlatan ki&#351;inin sorumlu&#287;u alt&#305;nda deildir. \r\n\r\n\r\n1-?nce kurban &#305;n ad&#305; b?l?m?ne girmek istedi&#287;imiz bilgisayar&#305;n ad&#305;n&#305; yaz&#305;yoruz. \r\n\r\n2-dns/&#305;p b?l?m? bahsetti&#287;im g?venli giri&#351; i sa&#287;layan sebeplerden birtanesi dir \r\nturkojan 2.0 kulanmak isteyen ki&#351;i e&#287;er sabit internet &#305;p sine saip deilse \r\nprogram&#305; servere yaz&#305;lan &#305;p dei&#351;ene kadar kullanabilir client in kullan&#305;ld&#305; \r\nbilgisyardaki internet &#305;p si dei&#351;ti&#287;i anda birdaha server olan bilgisayara ula&#351;am&#305;yacakt&#305;r. \r\ne&#287;er sabit &#305;p ye saip deilseniz buna ?nlem olarak ?rne&#287;in www.no-ip.com gibi servisler vard&#305;r \r\ndaha ?nce cigicigi forumda no &#305;p ile ilgili bilgiler vermi&#351;tim. \r\ndns/ip b?l?m?nde no-ip den ald&#305;&#287;&#305;n&#305;z dns yi yazarsan&#305;z &#305;p adresiniz dei&#351;se bile \r\nno-ip nin client ini kullanrak server olan bilgisayar&#305; sabit &#305;p adresiniz varm&#305;&#351; gibi y?nlendirebilirsiniz. \r\nbuda ayr&#305; bir g?venlilik''tir ??nk? sizin no-ip adresinizi ve &#351;ifrenizi siz vermedik?e kimsede bulunamaz ve ba&#351;ka biri o bilgisayara ba&#287;lanamaz. \r\n\r\n3-server &#351;ifresi b?l?m? ayr&#305;ca bir g?venlik''tir server e koydu&#287;unuz &#351;ifreyi de siz s?ylemedik?e ba&#351;kalar&#305; taraf&#305;ndan bilinemez. \r\nyani server bula&#351;t&#305;rd&#305;&#287;&#305;n&#305;z makinaya ba&#351;kalar&#305;n&#305;n ba&#287;lanamamas&#305; i?in \r\niki ayr&#305; ?ok ?nemli ?zellik vard&#305;r birincisi sabit ip niz yada no-ip den ald&#305;&#287;&#305;n&#305;z adres, \r\nikincisi servere koydu&#287;unuz &#351;ifre. \r\n\r\n4-ba&#287;lant&#305; port u \r\nturkojan 2.0 da otomatik belirlenen port 15963 t?r fakat siz isterseniz bunu dei&#351;tirebilirsiniz. \r\nwindows sisteminde 65545 tane port vard&#305;r burada dikkat edilmesi gereken &#351;ey port u yazarken windows un ve herhangi bir porgram&#305;n kullanmad&#305;&#287;&#305; \r\nbir port u yazmakt&#305;r e&#287;er kullan&#305;lan,aktif olan bir port yazarsan&#305;z server le di&#287;er program&#305;n port u ?ak&#305;&#351;aca&#287;&#305; i?in ba&#287;lanam&#305;yacaks&#305;n&#305;zd&#305;r. \r\nay&#305;rca turkojan &#305; kullanmak istiyene ler internete frewall ?zelli&#287;i olan bir adsl modem le ba&#287;lan&#305;yor ise. \r\nDNS/&#304;P ye yazd&#305;&#287;&#305; port la beraber 5741,5742,5743,5744,5745 port lar&#305;n&#305; modem ayarlar&#305;na girerek a?mas&#305; gerekiyor. \r\ne&#287;er bu portlar a?&#305;lmaz ise turkojan 2.0 &#305;n download upload ve ekran foto&#287;raf&#305; al gibi ?zelliklerini kullan&#305;lamaz. \r\n\r\n5-anahtar ad&#305; ve program ad&#305;. \r\nbu b?l?m?mdeki exe zant&#305;l&#305; ismi kendiniz dei&#351;tirebilirsiniz \r\nbu g?r?nen exe kar&#351;&#305; bilgisayarda ?al&#305;&#351;&#305;r olarak g?r?nen exe olucakt&#305;r. \r\n\r\n6-varsay&#305;lan simge ve simge se?. \r\nmeydana getirdi&#287;iniz server''e icon koymak i?indir turkojan 2.0 &#305; indirdi&#287;inizde programla beraber verilen \r\nicon lardan birini kullanabilirsiniz. \r\n\r\n7-dosya ile birle&#351;tir. \r\nhaz&#305;rlad&#305;&#287;&#305;n&#305;z serveri isterseniz ba&#351;ka bir dosya ile birle&#351;tirebilirsiniz. \r\n\r\n8-server''i Upx v 1.24 ile s&#305;k&#305;&#351;t&#305;r. \r\nt?m yukar&#305;daki ayarlaran&#305;z bittikten sonra server boyutunu oldu&#287;undan daha fazla ufaltabilirsiniz. \r\n\r\n9-kaydet \r\nart&#305;k serveri oluturabiliriz kaydet butonan una t&#305;klad&#305;&#287;&#305;m&#305;zda severi istedi&#287;imiz bir klas?r i?ine kay&#305;t edebiliriz. \r\n\r\nwww.turkojan.com \r\n\r\n\r\ndownload linki \r\nhttp://rapidshare.de/files/5237199/turkojantr.zip.html');
INSERT INTO `phpbb_posts_text` VALUES (23, 'd689cb947e', 'iRC De SeRViCeSsS HaCK...!', 'Arkadaslar bir serverde Admin Olduktan Sonra O serverin serviceslerini hackleye bilirsiniz hatta o hackten kurtulmak i?in mecburi olarak servicesleri yenilemek zorunda kalirlar Bunun icin once o server de admin olmaniz lazim. \r\nVe Yazdigim komutlari aliases e eklemeniz gereklidir. \r\nn10=/f1 \r\nn11 = /Gline $$1 . Hacked By $me \r\nn12=} \r\nn13=/f2 \r\nn14= /os killclones $$1 Hacked By $me \r\nn15=} \r\nn16=/f3 \r\nn17= /os sqline *a*b*c*d*e*f*g*h*i*j*k*l*m*n*o*p*r*s*t*u*v*y*z Hacked By $me \r\nn18=} \r\nn19=/f4 \r\nn20= /os akill add *@* Hacked By $me \r\nn21=} \r\n\r\nF1 ile herkeze Gline atarsiniz.F2 ile Botlari atarsiniz yada serverdeki cloneleri. \r\nF3 ile alfabeyi sqlineye alirsiniz b?ylece servere giren nick bile giremez ve bu yaziyi goruru Hacked By Sizinnickiniz.F4 ilede kimse giremez herkez akille allinir.');
