ngi birine basar&#305;z.Adresimiz genelde &#351;u &#351;ekilde olur. \r\n\r\nhttp://www.kurbansitesi.com/maillist.php?action=admin \r\n\r\nbu sayfa a?&#305;ld&#305;&#287;&#305;nda kar&#351;&#305;m&#305;z&#305; admin kullan&#305;c&#305; ad&#305; ve &#351;ifresini soran \r\n\r\nbir ekran gelir. Siz diyorsunuzki &#351;imdi kullan&#305;c&#305; ad&#305; ve &#351;ifresini nas&#305;l bulcaz \r\n\r\nsaatlerce bunlam&#305; u&#287;ra&#351;?az birdehay&#305;r u&#287;ra&#351;mayacaks&#305;n&#305;z. \r\n\r\nyapmak gereken &#351;ey yukardaki adres sat&#305;r&#305;ndan arad&#305;&#287;&#305;m&#305;z exploiti \r\n\r\nsilip yerine ba&#351;ka bir&#351;ey yazmak nedir bu anlatiyim. adres sat&#305;r&#305;ndaki \r\n\r\nhttp://www.kurbansitesi.com/maillist.php?action=admin &#351;u \r\n\r\nadresin uzant&#305;s&#305;n&#305; siliyoruz \r\n\r\nhttp://www.kurbansitesi.com ve bu kal&#305;yor adresin devam&#305;na &#351;unu \r\n\r\neklicez. \r\n\r\nml_config.dat \r\n\r\nyani yeni adresimiz \r\n\r\nhttp://www.kurbansitesi.com/ml_config.dat olacak entera basacaz. \r\n\r\nhoooop i&#351;te kar&#351;&#305;m&#305;za &#351;ifreler d?k?ld? sayfadaki ilk kelime kullan&#305;c&#305; \r\n\r\nad&#305; di&#287;er ise &#351;ifre &#351;imdi geri geliyoruz browser dan kullan&#305;c&#305; ad&#305; ve &#351;ifre \r\n\r\nsoran yere buldu&#287;um &#351;ifreleri yaz&#305;yoruz Vee i?erdeyiz orda wiew list diye \r\n\r\nbir se?enek var onu se?iyoruz maillistesini a?&#305;yor b?ylelikle maillistide \r\n\r\n?ald&#305;k. \r\n\r\n3.A&#351;ama ( Web sitesini ele ge?irmek ) \r\n\r\nSon olarak maillisti a?t&#305;k maillistlerin genelde ilk ba&#351;taki mail \r\n\r\nadresi admine ait olur bu mail &#351;ifreside b?y?k ihtimalle ?ald&#305;&#287;&#305;m&#305;z kullan&#305;c&#305; \r\n\r\nad&#305; veya &#351;ifre olabilir.Diyelimki tutmad&#305; ozaman bir de fake mail atmaya \r\n\r\n?al&#305;&#351;&#305;r&#305;z.E&#287;er bulnardan biri tutarda mailide k&#305;rarsak bu sefer sitenin \r\n\r\ndomainine bir whois ?ekeriz bakal&#305;