INSERT INTO `phpbb_posts_text` VALUES (74, 'ff9824a022', 'Benim hobby', 'Benim hobby\r\n\r\nBen kendim nerdeyse gunluk bilgisayar arkadasindayim,..\r\nEn az 6 saat  :roll: \r\n\r\nHem staj yerinden dolayi boyle yapmak zorundayim, hemde site yapmakla ugrastigim icin..\r\n\r\nOnun disi ben volleybol oynuyorum..\r\nBu pazartesi macimiz var, ama benim gitme niyetim yok :)\r\nUmarim arkadaslarim yenerler bu maci..\r\n\r\nAyrica her sali gunleri ise cami''ye gidiyorum, Bilgi alip ogrenmek icin. \r\n\r\nBunun disi, ben futbolu cok seven birisiyim.\r\nMac''lara bakmak degil, kendim oynamayi cok severim.\r\nHer persembe gunu benim antramanim oluyor volleybolun, ve bizden sonra ise, bir grup turkler geliyorlar, futbol oynamak icin, ben ise arada bi onlara katiliyorum :) yada volleybolun arasinda futbolmus gibi yapiyorum :)');
INSERT INTO `phpbb_posts_text` VALUES (75, '33559e1071', '27 ocak 2006', 'Benim gunlugum bugun..\r\n\r\nDun ogretmenimde bir mail aldim, ve bana yazdigi mailde &quot;Temmuz ayin''da bu okulu bitirip diplomani alabilirsin&quot; dedi.\r\nBunu okuyunca benim icimde bir heves olustu, cunku ben bir sene daha ugrasirim diye dusunmustum.\r\n\r\nSimdi ise, kendi kendime bir plan hazirladim.\r\nBenim bu okulu bitirmem icin, daha cok dersler var..\r\nOnumde 6 ay var. ve en az 20 isim var bitirmem gereken,\r\nayrica sinavim icinde ogrenmem gerekiyor,..\r\nYani anliyacaginiz, benim isim zor :)\r\n\r\nen az 20 derken az gorukuyor\r\nama inanki oyle degil...\r\n\r\nBugun o 20 olan dersimde 3''unu bitirdim. sadece kalan bu 3''undeki 1.isi sinifin karsisina cikip, anlatmam gerekiyor, o kullandigim konu hakkinda.\r\n\r\nayrica baska bir okula gitmek zorunda kaldim, kendim suan staj yerinde Systeembeheer vede helpdesk oldugum icin, beni hertarafa goturuyorlar :)');
INSERT INTO `phpbb_posts_text` VALUES (76, '8416e1e2b6', 'NeVSHo FaMiLiA NERDE!!!!?????', 'ooo..farkina variyorsaniz..\r\nartik kimse ilgilenmiyor sarki yapmakla..\r\nsarki yapmak istiyorsunuz,, ama nasil??\r\nsarki sizi davet edecek degil ya..????\r\n\r\nbu sozlerim\r\nmiss yagmur, misss gurbet ve karakus''a\r\n\r\nhaftaniz dolu olabilir, ama bir insanin icinde bir istedigi varsa, onuda o kalabalik haftanin icine katabilir\r\noyle degilmi???\r\n\r\nNeVSHo FaMiLiA silinecek bu gidisle..\r\ngecen senedir istiyoruz, ama bu 4 ay icerisinde ancak 1 tane sarkimi yapabildik???');
INSERT INTO `phpbb_posts_text` VALUES (77, '79957397ea', 'Bu fetvayi nerden aldin musluman? ( Siir )', '[color=red:79957397ea][b:79957397ea]Bu fetvayi nerden aldin musluman?[/b:79957397ea][/color:79957397ea]\r\n\r\n[color=red:79957397ea]vakkodan alinmis bone\r\ninanmasi cok zor Allahim bu ne\r\naltinda pantalon modaymis gene\r\ngiyinmek manasi ortunmek inan\r\nbu fetvayi nerden aldin musluman?\r\n \r\nkisa pardosuler dizden yukari\r\nrenk renk basortuler kirmizi sari\r\nyuz metlre oteden parlar jakari\r\nislami kiyafet bu degil inan\r\nbu fetvayi nerden aldin musluman?\r\n \r\ndaracik pardasu yirtmac yarisi\r\ntamamen ortada vucut yarisi\r\nbaslari dondurur parfum kokusu\r\ninsanin ziyneti hayirdir inan\r\nbu fetvayi nerden aldin musluman?\r\n \r\nten rengi coraplar gormez setreni\r\nmodada gececek alman ketreni\r\neli kolu kuyumcu vitrini\r\nislami yasayis bu degil inan\r\nbu fetvayi nerden aldin musluman?\r\n \r\nmoda diye bizi soydular\r\nortumuzu alip bi kenara koydular\r\nbizi oyle gorup sevinc duydular\r\nbizim dinimizde bu yoktur inan\r\nbu fetvayi nerden aldin musluman?\r\n \r\nmodern muslumanin isi pratik\r\nevinde esyasi hep otomatik\r\ndokun parmagin butun isler bitik\r\nbu rahatlik bizi bizden aldi musluman\r\nsadece mutluluk bu degil inan\r\nbu fetvayi nerden aldin musluman?\r\n \r\nsabah gezmesi kahveler fallar\r\ncarsi pazarlarda asindi yollar\r\noglum kizim diye yigildi mallar\r\nhayatin gayesi bu degil inan\r\nbu fetvayi nerden aldin musluman?\r\n \r\nkimisi avamdan kimisi dervis\r\ngozleri surmeli topuk bir karis\r\nmodern muslumanlar boyle giyermis\r\nislam''in ozunde bu yoktur inan\r\nbu fetvayi nerden aldin musluman?\r\n \r\nustunde pantalon kilarsin namaz\r\nne olur sozumu dinlesen biraz\r\nrasulullah seni boyle tanimaz\r\nsunneti yasamis olmazsin inan\r\nbu fetvayi nerden aldin musluman?\r\n \r\nzamani caldi diziler filmler\r\nRaflari susledi cilt cilt ilimler\r\nBizi gorse kahrolurdu alimler\r\nislami yasayis bu degil inan\r\nbu fetvayi nerden aldin musluman?\r\n \r\nsuslenir puslenir gezer dugunde\r\nyeri bas kosedir parali gunde\r\nAllah icin nefes tuket bir gunde\r\nislami ysayis bu degil inan\r\nbu fetvayi nerden aldin musluman?\r\n \r\nbirde deriz musluman''iz hepimiz\r\nkotuluk dusunmem, kalbimiz temiz\r\nnamaz borcumuzdur elbet birgun oderiz\r\ngercek muslumanlik bu degil inan\r\nbu fetvayi nerden aldin musluman?\r\n \r\nsen boyle degildin ne oldu sana\r\nkaygi duymuyorsun dininden yana\r\nsiyirdin ozunden dondun yabana\r\ngercek hssasiyet bu degil inan\r\nbu fetvayi nerden aldin musluman?\r\n \r\nsormayin dertliyim bunlardan yana\r\nsanli tarihine donup baksana\r\nuzulmezmi gore fatima ana\r\nAllah seni konu yapti Kuran''a\r\nNisa suresinde geciyor inan\r\nNeden acip okumuyorsun MUSLUMAN?[/color:79957397ea]');
