INSERT INTO `phpbb_posts_text` VALUES (152, '28bddcf78c', 'Mucize Bebek', 'Arkadaslar bu haber sizce normalmi? Bide siz okuyunuz !!!\r\n\r\n[img:28bddcf78c]http://i24.photobucket.com/albums/c27/gebruikers/bebeknehir.jpg[/img:28bddcf78c]\r\n\r\nAk?llara durgunluk veren olay.. 2 ayl?k bebe?i po?ete koyup canl? canl? g?le att?lar. Tam bir g?n g?lde kalan bebek, k?yl?ler taraf?ndan canl? bulundu. ??te kare kare mucize kurtulu?.\r\n\r\nBrezilya, ak?llara durgunluk veren bir olaya sahne oldu. Belo Horizonte kentindeki b?y?k park?n g?l?nde bir g?nd?r y?zen siyah ''''po?etin'''' i?inden, 2 ayl?k bebek ??kt?.\r\n\r\nG?lde y?zen siyah bir po?et, k?yl?ler taraf?ndan k?y?ya ?ekildi. ??inde canl? bir hayvan oldu?u san?lan po?etten, 2 ayl?k bir bebek ??kt?.\r\n\r\nMucize bebek, Brezilya''n?n Bello Horizonte eyaletinde bir g?lde, siyah bir po?etin i?inde bulundu. K?yl?ler, g?lde y?zen siyah po?eti, ellerindeki sopalarla k?y?ya ?ekti.\r\n\r\nAncak po?etteki k?p?rt?, herkesi ?a?k?na ?evirdi. K?p?rdayan po?ette ?nce bir hayvan oldu?unu san?ld?. Ard?ndan, po?etten minicik bir bacak ??kt?..?yice pani?e kap?lan k?yl?ler, po?ete yakla??p a?z?n? a??nca, 2 ayl?k bir bebekle kar??la?t?..\r\n\r\n?zerindeki k?yafetlerle po?ete konularak g?le at?lan bebek, uzun s?re suda kalmas?na ra?men hala canl?yd?. K?yl?ler, derhal bebe?i y?z?st? yat?r?p yuttu?u sular?n ??kmas?n? sa?lad?. Ard?ndan bebe?in ?slak giysileri ??kar?ld?. Mucize bebek battaniyelere sar?ld?. Ve sa?l?k durumunun ara?t?r?lmas? i?in hastaneye g?t?r?ld?.\r\n\r\nMinik bebe?e hastanede mama ve serum verilirken doktorlar, g?lde bir po?et i?erisinde bulunan bebe?in sa?l?k durumunun iyi oldu?u a??klad?.\r\n\r\nAnne G?zalt?na Al?nd?\r\nSao Paulo''nun 500 km kuzeydo?usunda yer alan Belo Horizonte''deki g?lde, ?ok s?cak olmas?na ra?men bo?ulmadan hayatta kalan bebe?in annesi g?zalt?na al?nd?.\r\n\r\nAnne, Pampulha g?l?nden ??kar?lan 2 ayl?k bebe?i hakk?nda, ''''?ok fakirim. ?ocu?uma bakamayaca??m i?in ona bakabilecek di?er evsiz yoksul insanlara inan?p verdim'''' dedi ve kendi eliyle bebe?ini g?le\r\natmad???n? s?yledi.\r\n\r\n?ki ayl?k bebe?in a?lama sesini duyanlar, g?ldeki siyah torbay? a?a? dal?yla ??kar?p ald?lar. Torbaya tak?l? tahta par?as?n?n bebe?in suya batmamas?n? sa?lad??? anla??ld?');
