INSERT INTO `phpbb_posts_text` VALUES (172, '8eddb93c9d', 'Kendini Bilen Rabbimi Bilir', 'Evet arkadaslar\r\n\r\nBir insan toprak, camur su ve ates ile yaratilmistir.\r\nve bunu hic unutmayin,..[b:8eddb93c9d]hersey[/b:8eddb93c9d] su ile yaratiliyor\r\ndusunun bi,...duvar yapmak icin neler lazim?\r\ncayirlar nasil buyuyor?\r\nve bircok seyler..\r\nbu anlatigim size belki sacma gelebilir, yani insanlar su, camur, toprak ve atesle yaratildigini, ama bu bir gercektir.\r\n\r\nbir insan derken,..ilk once dediginiz kelime nin anlamina bi bakiniz\r\nyani [b:8eddb93c9d]insan[/b:8eddb93c9d] ne demek?\r\nBiz kimmiz?\r\ninsan &gt; unutkan, erteleyici vede zeki''dir.\r\n\r\nVede yapmasi gerekenler ise...\r\nbir insan ilk once bilmesi gerek...Ben kimim [b:8eddb93c9d]akil[/b:8eddb93c9d]\r\ndogru ve yanlisi, guzelli ve cirkini ayirt etmesi gerektir.[b:8eddb93c9d]bilincli[/b:8eddb93c9d] \r\nvede [b:8eddb93c9d]imam etmek [/b:8eddb93c9d]gerekiyor arkadaslar..\r\n\r\nAllah bir insan yaparken, kendi ruhundan ufurmustur butun insanlara..yani bizede, herkese..\r\nve o ufurdugu ruhundan bize herseyin ismini ogretti.\r\n\r\nDunya''nin dondugunu baskalari tarafindan kastedilmis diye biliyoruz\r\nama biz bunu zaten biliyoruk aslinda o Allah''in bize ufurdugu ruhunun sayesinde.\r\nAma biz zekamizin 3''de birini kullaniyoruz..\r\nve o nedenle az bilincli oldugumuzu saniyoruz\r\nbiz 3''de 3''unu kullansak sence dunya nasil hale cevrilmis olur?\r\nteknology felan...\r\n\r\nbilirsiniz, melek''ler nur''dan yaratilmis\r\nseytan ise ates ten yaratilmis\r\nmelek''ler az bilincli olduklarini soylenir.ve Allah Adem''i yarattiginda ise melek''ler saygi gostererek, secde (sejde) verirken\r\nseytan vermek istemedi.\r\n\r\nsebebi ise &quot;Ben ondan bilincliyim, yukseyim, ve bilgim cok, ates topragi yakar&quot;dedi...\r\nAma bu sozu kullanirken birseyi unutmustu,...ve oda &quot;Allah ona ufurdugu ruhu, ne ates onu yakabilir nede herhangi birsey \r\n\r\nbu seytan ise bir sekilde cezalandiriyor..\r\nsecde (sejde) yapmadigi icin.\r\nkarsi ciktigi icin.\r\nAdem ve seytani ozaman dunyaya getiriliyor..\r\nbirbirilerine dusmanlar tabiki...\r\n\r\nDevami ise sonra&gt;&gt;&gt;&gt;&gt;&gt;&gt;');
