INSERT INTO `phpbb_posts_text` VALUES (332, 'dd6880c87c', 'Phpbb''den Forum Acmak', 'Merhaba arkadaslar\r\n\r\nBelki aranizda forum acmak isteyen olur.\r\nPhpbb 2.0.x yada phpbb plus.\r\nlimietsiz, istedigini sen karar veriyorsun\r\ndatabase sen yonlendiriyorsun\r\nreklamsiz\r\n\r\nBir forum kurmak okadar kolayki\r\n\r\nSize lazim olanlar\r\n\r\n1.ftp server\r\n2.host &gt; mysQl, php katkili olmasi gerek\r\n3.phpbb dosyasi\r\n\r\nilk once [url=http://www.phpbb.com/downloads.php]BURDAN[/url] son versiyonu indiriyorsunuz\r\nZip dosyasini aciyorsunuz,...( dizini cikart, ve biryere yukleyiniz )\r\n\r\nbir yerden host aciyorsunuz ( [url=http://bizimalem.pfwh.net/forum/viewtopic.php?t=43]buraya tiklayin bazi ornek hostlar icin[/url] )\r\n\r\nftp ile butun dosyayi hostunuza yukluyorsunuz\r\nornegin &gt; siteniz lycos dan yaplimis.\r\n\r\nhttp://members.lycos.co.uk/[color=red:dd6880c87c]kullaniciadiniz[/color:dd6880c87c]/forum\r\n\r\nbu kismina phpbb''deki dosyalari yukluyorsunuz, ve hersey tamamladik''tan sonra\r\n\r\nhttp://members.lycos.co.uk/[color=red:dd6880c87c]kullaniciadiniz[/color:dd6880c87c]/forum/install/install.php\r\n\r\nsayfasina giriyorsunuz\r\n\r\nhost''unuzda yapmis oldugunuz database bilgilerini o sayfada yaziyorsunuz\r\n\r\n[img:dd6880c87c]http://i24.photobucket.com/albums/c27/gebruikers/installphpbb.jpg[/img:dd6880c87c]\r\n\r\nburda birtek bunlari duzeltiyorsunuz\r\n\r\n[b:dd6880c87c][color=darkred:dd6880c87c]Your database name\r\ndatabase username\r\ndatabase password\r\n\r\nAdmin e-mail address\r\nAdministrator username\r\nAdministrator password\r\nAdministrator password [Confirm][/color:dd6880c87c][/b:dd6880c87c]\r\n\r\nsonunda &quot;start install&quot; basiyorsunuz, ardindan &quot;finish installation&quot;\r\nondan sonra sizden contrib vede install dosyasini sildirmenizi ister\r\no iki dosyayi tum silin, ve forum acik, calisiyor..\r\n\r\nSon olarak bakmaniz gereken\r\n\r\nkendinize ozel mesaj gonderin, ve bakin emailer.php diye bir error cikiyormu diye.\r\negerki cikiyorsan, sorun host dadir.\r\nya hostunuza bir mail gonderirsiniz, ve bu sorunu onlarin cozmesini saglarsiniz, yada siz baska host acarsiniz.\r\n\r\negerkioyle bir error cikmazsa, bazi testler yapiniz, hersey iyi calisiyormu diye. ondan sonrada her istediginizide yuklersiniz...');
