mektir. Sevgiliden gelen ?l emrine bile ?l?r?m diyebilmektir. Kendi elleriyle kalbini bir b??ak ucuna koymakt?r sevmek. \r\nSevmek ?lmektir. \r\nSevmek, ?lmesini bilmektir. \r\nSevgili i?in ya?amakt?r. Onun eli, kolu, g?z?, kalbi olmakt?r. Ama art?k onun bir ?eyi olunmad??? bir zaman ?lmesini bilmektir! Sevmek, vermektir. Sevmek sevdi?i i?in almas?n? bilmektir. Almamaya yemin ederek vermektir. Ama almalarda kurtaracaksa sevgiliyi almas?n? bilmektir sevmek! \r\nSevmek, t?kenmektir. Sevmekten ?l?rken tekrar varolmakt?r o sevgiden. \r\nSevmek sevgilinin gel deyi?ine hay?r demektir. Sevgilinin a?k?yla bo?u?urken, y?zerken o a?k denizinde sevgilinin uzanan eline hay?r demektir. \r\nSevgilinin bakan g?z?ne bakmamakt?r sevmek. A?layan g?zlere ?efkat ve tebess?mle yan?t verebilmektir. \r\nSevmek, sevgili olmakt?r. Sevgilinin y?z?ndeki g?l?c?k olmakt?r. Onu ya?ama d?nd?recek bir damla su olmakt?r. Sevmek sevgilinin liman? olmakt?r. Sevmek sevdi?inin can? olmakt?r. Onun ?l?m? isteyebilece?i can? olmakt?r. Sevmek yang?n olmakt?r. Yanmakt?r, kor olmakt?r. Da? olmakt?r, evren olmakt?r. Her ?ey olmakt?r, hi? olmakt?r. Alev olup girmektir g?n?llere. \r\nSevmek y?r?mektir g?n?llerde. \r\nSevmek g?venmektir. \r\nSevmek onaylanmakt?r. \r\nSevmek sevgiliye bir nefes gibi, bir ses gibi yak?n olmakt?r. Sevmek ?ok ?telerde olsa bile ya?amak ve yak?n olmakt?r sevgiliye. Yak?nl?l?kt?r, do?all?kt?r, ?zdenliktir sevmek. \r\nYalans?zl?k, i?tenlilik, ?l?ms?zl?l?kt?r sevmek. ?lk insan?n, Havva''n?n Adem''in safl???n? ve temizli?ini, ?ocuk masumlu?unu ta??makt?r sevmek. \r\nG?zya?? olmakt?r, ya?an ya?mur olmakt?r. Bir sonbahar mevsiminin sar? yapra?? gibi yaln?z olmakt?r sevmek. \r\nSevgilisizken sevgiliyi sevmektir. \r\nSevmek ???mektir. Sevgilinin yoklu?una ???mektir. \r\nSevgiliyle her ?eyi g?ze almakt?r sevmek. Ki sevgilinin oldu?u cehenneme y?r?mektir. Sevgilinin olmad??? Cennete de gitmemektir sevmek. \r\nSevmek, sevgiliyi cennet etmektir. \r\nSevmek bir olmakt?r. \r\nSevmek ya?amakt?r. \r\nVe sevmek inanmakt?r. \r\nSevmek bir ba?kas?n?n hayat?n? ya?amakt?r. \r\nSevmek sevmesini haketmektir. \r\nSevmek sevgilinin bakt??? yerde, sustu?u yerde olmakt?r. \r\nSevmek sevgilisiz ge?en gecelerin sabah?na varmakt?r. S \r\nevmek saz benizli sabahlarda ya?amakt?r sevgiliyi. \r\nSevmek sevmesini bilmektir. \r\nSevmek ?lmesini bilmektir. \r\nSevmek SEVMEK olmakt?r. \r\nA?K olmakt?r. \r\nA?k bir kere sevmektir. \r\nSevmek a?k?n kendisi olmakt?r. \r\n?l?m? ?zlemeyen A?k? Anlayamaz..');
INSERT INTO `phpbb_posts_text` VALUES (408, '12a0e40de8', 'ask', 'SENI SEVIYORUM! DIYEN DILLERE DEGIL...SENIN ICIN AGLAYAN GOZLERE INAN...  \r\n \r\n  \r\nINSANIN INSANA VEREBILECEGI EN OLUMSUZ HEDIYEDIR SEVGI...  \r\n \r\n  \r\nUNUTMA KI INSAN SEVEBILDIGI KADAR INSANDIR.  \r\n \r\n  \r\nINSANLARIN UMUDUNU KIRMA..BELKI DE SAHIP OLDUGU TEK SEY ODUR.  \r\n \r\n  \r\nDUNYADA PAYLASILDIKCA BUYUYEN TEK SEY SEVGIDIR.HAYDI O ZAMAN PAYLASALIM...  \r\n \r\n  \r\nNE OLURDU BIR YAPRAGIN DAHA OLSA!BAK SEVMIYOR ISTE BENI HAIN PAPATYA!  \r\n \r\n  \r\nASK GUNAH OLMAYACAK KADAR MASUM,KOLE OLMAYACAK KADAR OZGUR,UNUTULMAYACAK KADAR DERIN,UMULMAYACAK KADAR YAKIN,TEK BASINA YASANMAYACAK KADAR TAKIMDIR...  \r\n \r\n  \r\nBEN SENI SECTIM SEN BENIM ICIN YALAN DUNYADAKI TEK GERCEKSIN...  \r\n \r\n  \r\nUZAKLIKLAR KUCUK SEVGILERI YOK EDER BUYUKLERI ISE YUCELTIR TIPKI RUZGARIN MUMU SONDURUP ATESI YUKSELTTIGI GIBI...  \r\n \r\n  \r\nDUNYA DA HERSEY KENDINE BIR ES ARAR,TASIN KALBI YOKTUR AMA ONU DA YOSUN SARAR...  \r\n \r\n  \r\nASKIMIZ KARA BULUTLARLA KAPLIYSA EGER..YAGMURUN YAGMASINI BEKLE CUNKU HER YAGMURDAN SONRA GOKKUSAGI CIKAR...  \r\n \r\n  \r\nBIR GUN GUNES DOGMAYI AY BATMAYI UNUTURSAA BEN DE SENI UNUTACAGIM...  \r\n \r\n  \r\nICTIGIM SIGARAM GIBIYDIN ARAMIZDA TEK BIR FARK VARDI SIGARAMI BEN BITIRDIM BENIDE SEN...  \r\n \r\n  \r\nSENIN OLAN HERSEYI SENSIZLIGI BILE SENI HATIRLATTIGI ICIN SEVIYORUM...  \r\n \r\n  \r\nUNUTMA BAL YAPAN HER ARININ KUYRUGUNDA BIR IGNESI VARDIR.  \r\n \r\n  \r\nDENIZ YA KUDURMALI YA DURULMALI,HANCER YA SONUNA KADAR SAPLANMALI YA KININDA DURMALI.SEVECEKSE INSAN YA OLUMUNE SEVMELI,YADA HIC.  \r\n \r\n  \r\nINSANLAR TANIDIM YILDIZLAR GIBIYDILER,HEPSI GOKTEYDI AMA BEN SENI GUNESIM SECTIM VE BIR GUNES ICIN BIN YILDIZDAN VAZGECTIM.  \r\n \r\n  \r\nASK BIR ELMA SEKERIDIR. YERSIN YERSIN ELINDE KAZIGI KALIR.  \r\n \r\n  \r\nBASINI GOGSUME YASLADIGIN ZAMAN TEK DUSMANIM AKIP GIDEN ZAMANDIR.  \r\n \r\n  \r\nDUN YINE YAPAYALNIZ, DOLASTIM YOLLARDA...YAGMURLARIN ISLATTIGI, BOMBOS SOKAKLARDA.GOZLERIMDE YAS, KALBIMDE SIZI, UNUTMADIM SENI, UNUTAMADIM, UNUTAMADIM, NE OLUR ANLA BENI...  \r\n \r\n  \r\nHAYATINDAKI UZUNTULER KUMSALDAKI AYAK IZLERI KADAR GECICI MUTLULUKLARSA MERMERE KAZINAN YAZILAR KADAR KALICI OLSUN...  \r\n \r\n  \r\nSENIN ICIN UZAKTAN SEVMEYI,BAKMADAN GORMEYI,DOKUNMADAN,HISSETMEYI,DUYMADAN DINLEMEYI,GOZ YASLARIMLA GULMEYI VE KAVUSMAK ICIN SABRETMEYI OGRENDIM AMA SENSIZLIGE ASLA...');
INSERT INTO `phpbb_posts_text` VALUES (409, '458b8e05ec', 'ask 1', 'BIR BAKISIN MANASI, HIC BIR LISANDA YOKTUR, BIR BAKIS BAZEN SIFA, BAZEN ZEHIRLI BIR OKTUR, BIR BAKIS BIR ASIGA NELER NELER ANLATIR, BIR BAKIS BIR ASIGI SENELERCE AGLATIR...  \r\n \r\n  \r\nUNUTMA! NASIL SENSIZLIGI BEN YARATMADIMSA TADACAGIN BENSIZLIKTE BENIM ESERIM OLMAYACAK...  \r\n \r\n  \r\nKENARDAN BEN GECEYIM YOL SENIN OLSUN BEN ZEHIR ICEYIM SU SENIN OLSUN BI SEVGILI BULMUSSUN HAYIRLI OLSUN BI TANE DE BENIM VAR HABERIN OLSUN.  \r\n \r\n  \r\nFIZIK ILE BULDUM, KIMYA ILE COZDUM, EDEBIYAT ILE SOYLUYORUM, SENI COK SEVIYORUM  \r\n \r\n  \r\nGULU OYLESINE SEVMELISIN KI SORANLARA DIKENI YOK DIYEBILMELISIN.  \r\n \r\n  \r\nBIR INSAN OLUNCE UNUTULMAZ, UNUTULUNCA OLUR!  \r\n \r\n  \r\nSENII SEVDIGIM KADAR YASASAYDIM,OULSUZ OLURDUM.... SEN HALA SONSUZLUDUN YUZUNDE BIR DAMLA GOZYASISIN..  \r\n \r\n  \r\nFIRLATMISTIM KALBIMI UZAGA,EN UZAGA.DENK GELIRDE RASTLAR DIYE BIR YILDIZA...YANILIP SUSTURDUM,AGRIMIN CAGRISINI,CAGRIMIN KOHNEMIS AGRISINI...  \r\n \r\n  \r\nOYSA KIM BILIR KI ,YANAGIMDA YANGINLARDAN COK ONCE O YARIN BIRAKTIGI OPUS IZI VAR... YUREGIMDE ANILARDAN KALAN BIN DUS IZI VAR...  \r\n \r\n  \r\nKANMADIM AYNALARA SANA KANDIGIM KADAR...ICIMDE BIR BOSLUK SANA YANDIGIM KADAR..  \r\n \r\n  \r\nBIR CIFT ELA GOZ YUZUNDEN ICIMDE BIR SONBAHAR ACIYOR OYLE ACIYOR KI, ACILAR ACISIZ KALIYOR, MEVSIMLER USTUME DEVRILIYOR,KISLAR KISSIZ KALIYOR...  \r\n \r\n  \r\nPASLI BIR YANLIZLIKTI AVUCLARIMDA...ARDIMDA BIR YUREK YUKU RUZGAR...NE ZAMAN SEVMEYE KOYULSAM,DOGRULUP COGALDI AYRILIKLAR...  \r\n \r\n  \r\nSENI SILDIGIMDE, ANILAR DEFTERINDEN,BILIYORDUM SOKUP ATTIGIMI HAYATIMIN YARISINI \r\n \r\n  \r\nERKEKLER MI DAHA AKILLI YOKSA KADINLAR MI , CEVAP VERMEK COK ZOR AMA SIZ HIC BACAKLARI GUZEL DIYE BIR ERKEGIN ARKASINDAN KOSAN KADIN GORDUNUZ MU?  \r\n \r\n  \r\nSOKAKTA BIR KIZ GORDUM TAKILDI GOZLERIM GOZLERINE, ASIGIM ZANNETTI BENI KENDINE, HALBUKI NE BILSIN, BENZIYORDU GOZLERI GOZLERINE  \r\n \r\n  \r\nSENI SEVIYORUM DERKEN HIC YALAN SOYLEMEDIM, YALAN SOYLERKEN HIC SENI SEVIYORUM DEMEDIM!!!  \r\n \r\n  \r\nANSIZIN UYANIRSAM GECENIN BIR YAISINDA,GOZLERIN DALARSA SONSUZ KARANLIGA,BIR SICAKLIK DUYARSAN USUYEN AVUCLARINDA,BILKI SENI DUSUNUYORUM  \r\n \r\n  \r\nSAKIN SEVMEKTEN KORKMA,KURSUN SESI KADAR HIZLI GECER YASAMAK,AMA OYLE ZORKI KURSUNU HAVADA,SEVDAYI SICACIK YUREKTE TUTMAK...  \r\n \r\n  \r\nSENI SEVDIGIMI KIMSE BILMIYOR YANLIZ KALBIM ODA DILSIZ  \r\n \r\n  \r\nBASKA BIR RENGI SEVMEYEN RENK OLUR,BEN SENI SEVIYORUM KALBIM GOK KUSAGI  \r\n \r\n  \r\nARAMIZDAKI MESAFELER NE KADAR UZAK OLURSA OLSUN SONSUZLUGA GIDEN TUM YOLLARA ADINI YAZDIM. HANGI YOLDAN GECERSEN GEC SENI SEVDIGIMI OKUYACAKSIN.  \r\n \r\n  \r\nHIC ASIK OLMAMIS KADINLAR BULUNABILIR AMA,HAYATINDA BIR KEZ ASIK OLMUS KADIN PEK AZDIR..  \r\n \r\n  \r\nBIR GUN BANA GULEN GOZLERLE SORACAKSIN,BEN MI, DUNYA MI DIYE,BEN DUNYA DIYECEGIM VE SEN CEKIP GIDECEKSIN AMA BILMEYECEKSIN KI TUM DUNYANIN SEN OLDUGUNU...  \r\n \r\n  \r\nBUGUN DUNYAYI ISTEDIGIN RENGE BOYAYIP BU RENGI INSANLARA TUM SEVGINLE DAGIT...KENDINI SEVGININ BIR RENGI DIYE TANIT...CUNKU SENIN VARLIGIN SEVGIYE EN GUZEL TANIK...  \r\n \r\n  \r\nNASILKI UZAKTAKI YILDIZ PARLAK GELIR YA INSANA UZAKTA OLDUGUN ICIN TUTKUNUM SANA HANI EN GUZEL ASK IMKANSIZ GELIR YA INSANA IMKANSIZ OLDUGUN ICIN ASIGIM SANA SENI COK SEVIYORUM HEMDE ISTEMEDIGIN KADAR COK SEVIYORUM...  \r\n \r\n  \r\nSANA OLAN SEVGIM ISTANBUL KADAR BUYUK ANKARA KADAR ANLAMLI ANTALYA KADAR EGZOTIK BURSA KADAR CEKICI DIYARBAKIR KADAR KABADAYI BATMAN KADAR VAZGECILMEZDIR,BITANEM...  \r\n \r\n  \r\nSEN BENIM ICIN VAZGECILMEZSIN.CUNKU SENI SEVMEK NEFES ALMAK GIBIDIR...  \r\n \r\n  \r\nSAFAK VAKTI YAGAN BIR CIG TANESI KADAR MASUM GUN BATIMINDA DENIZLERDEN ESEN RUZGAR KADAR CILGIN VE OKYANUSUN DERINLIKLERINDEKI BIR INCI TANESI KADAR OZELSIN.  \r\n \r\n  \r\nBATARYASI ZAYIFLAMIS HAYELLERIMIN KAPSAMA ALANI DISINDA KALAN KESIMLERINE SEBEKE HATASI YUZUNDEN ULASAMADIM OYSA SIMDI YUREGIMDE FULL CEKEN HATTIMLA SENINLEYIM.  \r\n \r\n  \r\nELIMDE DENIZDEN CIKARDIGIM BIR MIDYE KABUGU VAR.DENIZDEN O KADAR UZAKKI.TIBKI BENIM SANA UZAK KALDIGIM GIBI.  \r\n \r\n  \r\nSENDEN SEVGI DILEDIGIMDE YALVARDIGIMI SANMA. BENIM KITABIMDA OLESIYE SEVMEK VAR, AMA YALVARMAK ASLA.  \r\n \r\n  \r\nSENI GORDUGUM ILK ANI HATIRLIYORUM. VE HIC DURMADAN AGLIYORUM.  \r\n \r\n  \r\nO KESTANE RENKLI GOZLERIN, SENI HEP SEVERIM, EGER ISTESEM BANA BIR OPUCUK VERIRMISIN, VERIRSEN SEVINIRIM.  \r\n \r\n  \r\nBAL DEYIP VERSENDE ZEHIRI GULUM SEVEN CEKER BUNCA KAHIRI GULUM GELSEDE OMRUMUN AHIRI GULUM SANA ASIK OLAN YANIM VAR BENIM ARDIMSIRA BIR DAMLA YAS AKMASA AHIRETTE KIMSE SAHIP CIKMASA TANIMASA YUZUME DE BAKMASA SEN GIBI SULTANIM HANIM VAR BENIM...  \r\n \r\n  \r\nCARSIDA KAYBOLAN COCUGUN ELINDE SOGUYAN ANNE SICAKLIGI HIZIYLA AYRILDIN BENDEN, OYSA BEN CAY BARDAGINDA BIRAKILAN DUDAK PAYI KADAR BILE AYRI KALAMAM SENDEN!  \r\n \r\n  \r\nSEVGI YUREK ISTER SEN YALANCISIN SEVGIDEN ANLAMAYAN BIR ZAVALLISIN,  \r\n \r\n  \r\nSENI ICIMDEN ATIYORUM HERGUN BIRAZ BIRAZ, AYRILIGA DA ALISILIR UNUTMA.INSANIZ NELER GORECEGIZ DAHA, SENIN SEVGIN NEDIR KI KOCA DUNYADA!  \r\n \r\n  \r\nBAZAN KAR NASIL HAZIN YAGAR BILIRSIN KURSUNI BIR GOKYUZUNDEN AGLAMAKLI ISTE OYLEYIM, KAPKARAYIM BU GUN GEL EN HUZUNLU SESINLE, EN DOKUNAKLI,  \r\n \r\n  \r\nDALGALARCA DALGALANDIM RUZGARCA ESTIM YUREGIMI SANA GETIRDIM SEN CAN ISTEMISSIN CANDAN DA OTE DOSTUM YUREGIMI SANA GETIRDIM  \r\n \r\n  \r\nBELKI YUZUM GULECEK DONECEGIM SASKINA BELKI MAHKUM OLACAK OMUR BOYU ASKINA BU KARARI VERIRKEN SAKIN BANA DEME TOY SENSIZ BEN YASAYAMAM ELINI KALBIME KOY...  \r\n \r\n  \r\nYUREK VERMEZ YUREKLIYE DARILDIM KUSTUM YUREGIMI SANA GETIRDIM BIR GUVERCIN KANADININ UCUNA DENIZLERDE TUZ KOYMADIM YARAMA BASTIM YUREGIMI SANA GETIRDIM SESIMIN IBRESI AZ KONUS DEDI.  \r\n \r\n  \r\nSEN SON CUMLE, BEN NOKTAYIM BITME BENSIZ BITME SAKIN BANA BENDEN UZAKTAYIM, SANA SENDEN FAZLA YAKIN. SEN KOR EBE, BEN YOKTAYIM AZLIGINI BILDIM COK''UN HEM KARADA HEM AYAKTAYIM GOZSUZ GORUP, ELSIZ DOKUN,  \r\n \r\n  \r\nSEN GELIPTE PISMANIM DESEN BANA CEZA VER RAZIYIM CEZAMA DESEN SANA TEK BIR CEZA VERIRDIM SENINDE BENIM GIBI SEVMENI ISTERDIM  \r\n \r\n  \r\nBIR DELI ASIK OLMUSUM NE GUNUM NE GECEM BELLI BIR DELI HASRETE VURULMUSUM NE DUNUM NE YARINIM BELLI GIDIYORSUN DIYORUM SUREKLI BENDE ASK SAHI SEVGILIM SEN GELDIN MI KI?');
INSERT INTO `phpbb_posts_text` VALUES (410, 'c87502a767', 'Sevgililer G?n?', 'HADI GEL TUT ELLERIMI! BENIMLE YAN! BENIMLE MEYDAN OKU HER CARESIZLIGE! BENIMLE UYU BENIMLE UYAN. BIRLIKTE VARALIM NICE YILLARA.  \r\n \r\n  \r\nDENIZI ICERKEN MAVILER TAKILDI BOGAZIMA, KARAYA VURAN BALIK GIBI CIRPINIYORUM. MAVI GOZLERINI OZLUYORUM. SEVGILILER GUNUN KUTLU OLSUN.  \r\n \r\n  \r\nGOZLERIN NEHIR KIRPIKLERIN KOPRU OLSA, BEN UZERINDEN GECERKEN IPLER KOPSA VE DUSTUGUM YER DUDAKLARIN OLSA. SEVGILILER GUNUNDE BIR OPUCUK BORCLUSUN BANA...  \r\n \r\n  \r\nHANI EN GUZEL ASKLAR IMKANSIZ GELIR YA INSANA, IMKANSIZ OLDUGUN ICIN ASIGIMSANA!.. SEVGILILER GUNNU KUTLU OLSUN BIRTANEM, SENI COK SEVIYORUM.  \r\n \r\n  \r\nSEN COLLERDE SERAP GIBISIN, ENGIN DENIZLERDE YAKAMOZ GIBISIN, ISIGIM SENSIN, GUNESIM SENSIN... BIL KI COK OZLENDIN... SEVGILILER GUNUN KUTLU OLSUN!  \r\n \r\n  \r\nSEVGILILER OPUSURKEN NEDEN GOZLERINI KAPATIR BILIR MISIN? CUNKU GOZLERIYLE DEGIL DE KALPLERIYLE GORMEK ISTERLER. YANI HISSETMEK ISTERLER. BEN DE SENI RUHUMUN DERINLIKLERINDE HISSEDIYORUM SEVGILIM CUNKU SENI COK SEVIYORUM. SEVGILILER GUNUMUZ KUTLU OLSUN!  \r\n \r\n  \r\nMAVILER GIYER BULUT OLURUM, YESILLER GIYER BAHAR OLURUM, BAKARSIN BIR GUN BEYAZLAR GIYER SENIN OLURUM. SEVGILILER GUNUN KUTLU OLSUN.  \r\n \r\n  \r\nBULUTLARA YUKLEDIM HASRETIMI, RUZGARLARLA YOLLADIM SEVGIMI, YAGMURLAR YAGDIRDIM GOZYASLARIMLA KUCUK MELEKLER GONDERDIM SENI OPMEYE! SEVGILILER GUNUN KUTLU OLSUN!  \r\n \r\n  \r\nBIR KUS OLUP GITSEM, ASSAM SU ENGINLERI, VARSAM SENIN YANINA. OPSEM DOYASIYA, KOKLASAM SENI, EN BUYUK HEDIYE ODUR BANA.  \r\n \r\n  \r\nBIR YUDUM SEVGI KOSKOCA BIR OKYANUSA BEDELDIR. SIMDI UZAKLARDA SENIN BIR YUDUM SEVGINE HASRETIM SEVGILIM. SENI HASRETIMI TUKETIRCESINE KUCAKLIYORUM.  \r\n \r\n  \r\nSANA DOGRU BIR KELEBEK UCURDUM, DAGLARI DENIZLERI ASTI SENI BULDU, YANAGINAUFACIK BIR OPUCUK KONDURDU. HISSETTIN MI? SEVGILILER GUNUN KUTLU OLSUN!  \r\n \r\n  \r\nDOGAN HER GUNUN SABAHINDA ICIMDE GOZLERINI GOREBILMEK ASKI OLMASA, INAN HICBIR SEYE DEGMEZDI YASAMAK. SEVGILILER GUNUN KUTLU OLSUN!  \r\n \r\n  \r\nSENI SEVDIGIM KADAR YASASAYDIM OLUMSUZLUGUN ADINI ASK KOYARDIM... SEVGILILER GUNUN KUTLU OLSUN BIRICIK ASKIM!  \r\n \r\n  \r\nYUREGIMDEKI TEK ARZU, HAYALIMDEKI TEK TUTKU, BENI YASATAN TEK DUYGU SENMISSIN BEBEGIM... SEVGILILER GUNUNU KUTLUYORUM. DAHA NICE YILLARA.  \r\n \r\n  \r\nGUNESIN DOGDUGU DA BIR GERCEK BATTIGI DA... KALBIMIN ATTIGI DA BIR GERCEK, GUNUN BITTIGI DE... NE CIKAR TUM GERCEKLERI SAYSAK TEK TEK. SENI SEVIYORUM, ISTE O EN BUYUK GERCEK...  \r\n \r\n  \r\nOPERIM DUDAKLARINDAN GUL KOKULU YANAKLARINDAN HER DEM GOZLERIMIN HAPSINDESIN KALBIMIN TEK SAHIBISIN... SEVGILILER GUNUN KUTLU OLSUN!  \r\n \r\n  \r\nGULLER ANLATSIN SANA OLAN SEVGIMI, GULLER ANLATSIN YANLIZLIGIMI, CARESIZLIGIMI. YAVAS YAVAS ERIYEN YUREGIMI GULLER ANLATSIN BEN ANLATAMADIM.  \r\n \r\n  \r\nSEN BENIM HAYATIMDA OLDUGUN SURECE, NE SEN KIMSEYE RAKIP NE DE KIMSE SANA RAKIPTIR. DAHA NICE SEVGILILER GUNUNDE BERABER OLMAYI DILIYORUM.  \r\n \r\n  \r\nSANA DIJITAL BIR GUL YOLLUYORUM, CUNKU UZAKLARDA ELIMDEN ANCAK BU KADARI GELIYOR. AMA BIL KI GERCEGINI, GOZLERININ ICINE BAKARAK VERMEK ISTERDIM. VE SENI SEVDIGIMI FISILDAMAK.. SEVGILILER GUNUMUZ KUTLU OLSUN!  \r\n \r\n  \r\nDUN GECE SEN UYURKEN KIZILA BOYADIM DENIZLERI, UCURUMDAN ATTIM SESSIZLIGI, HABER SALDIM RUZGARLARA FISILDASINLAR SENI NE COK SEVDIGIMI VE OZLEDIGIMI.  \r\n \r\n  \r\nAYRILIK KUCUK SEVGILERI OLDURUR AMA BUYUK SEVGILERI GUCLENDIRIR. TIPKI RUZGARIN MUMU SONDURUP YANGINI GUCLENDIRDIGI GIBI... BIZIM DE SEVGIMIZ HEP YASAYACAK VE DAHA DA GUCLENECEK SEVGILIM. NICE SEVGILILER GUNLERINDE BIRLIKTE OLMAK DILEGIYLE...  \r\n \r\n  \r\nSEN DUNYAYA SURGUN BIR MELEKSIN VE BEN SENI O KADAR COK SEVECEGIM KI BIR DAHA CENNETINE GERI DONMEK ISTEMEYECEKSIN... SEVGILILER GUNUN KUTLU OLSUN!  \r\n \r\n  \r\nSEVGILILER GUNUNDE BELKI YANINDA DEGILIM AMA DUNDE, BUGUNDE, YARINDA YUREGIN KADAR YANINDAYIM. KENDINI YALNIZ HISSETTIGINDE ELINI KALBINE KOY BEN HEP ORDAYIM!  \r\n \r\n  \r\nGONLUME TAHT KURDUN, GONLUMUN SULTANI OLDUN, GECE GOKYUZUNDE PARLAYAN YILDIZIM, SABAH ISE RUHUMA DOGAN GUNESIM OLDUN. SEVGILILER GUNUN KUTLU OLSUN!  \r\n \r\n  \r\nO KADAR GUZELSIN KI YUZUNE BAKAMIYORUM. TITRIYOR ELLERIM, ELLERINI TUTAMIYORUM. OYLESINE BAGLANMISIM KI SENSIZ DURAMIYORUM. SEVGILILER GUNUN KUTLU OLSUN!  \r\n \r\n  \r\nBANA BIR GUNUN 24 SAAT, BIR SAATIN 60 DAKIKA VE BIR DAKIKANIN 60 SANIYE OLDUGU OGRETILDI AMA SENSIZ GECEN BIR SANIYENIN SONSUZLUK KADAR UZUN OLDUGU OGRETILMEDI. YASAMIMIZIN HER ANINDA BIRLIKTE OLMAMIZ DILEGIYLE SEVGILIM... SEVGILILER GUNUMUZ KUTLU OLSUN.  \r\n \r\n  \r\nBUTUN MEVSIMLERI BIR GUNDE, BUTUN YILLARI BIR MEVSIMDE YASAMAYA RAZIYIM SENINLE... DAHA NICE SEVGILILER GUNUNU BERABER GECIRMEK DILEGIYLE..  \r\n \r\n  \r\nINSANLAR TANIDIM YILDIZLAR GIBIYDI, HEPSI PARLIYORDU. AMA BEN SENI, GUNESI SECTIM, BIR GUNES ICIN BIN YILDIZDAN VAZGECTIM. SEVGILILER GUNUMUZ KUTLU OLSUN!  \r\n \r\n  \r\nBU SEVGILILER GUNUNDE BEYAZ BIR GUVERCIN YOLLUYORUM SANA KANATLARINDA MUTLULUK, YUREGINDE SEVGI VE SADAKAT, KARBEYAZ TUYLERINDE UMUT VE GAGASINDA IYI GECELER OPUCUGU, YANAGINI UZAT.  \r\n \r\n  \r\nSENI HER DUSUNDUGUMDE KALBIME BIR YILDIZ CIZIYORUM. BENIM SIMDI KAC YILDIZIM VAR BILIYOR MUSUN? BENIM ARTIK BIR GOKYUZUM VAR... SEVGILILER GUNUMUZ KUTLU OLSUN!  \r\n \r\n  \r\nHANI GOZLER VARDIR SOZLERI ANLATIR, HANI SOZLER VARDIR GOZLERI ANLATIR, BIR DE ASK VARDIR SENI ANLATIR... NICE SEVGILILER GUNLERINE MINIK BEBEGIM.  \r\n \r\n  \r\nBUGUN HER ZAMANKINDEN FARKLI BIR SEY YAPAYIM DEDIM OLMADI YINE SANA DEFALARCA ASIK OLUP SENI DUSUNDUM... SEVGILILER GUNUN KUTLU OLSUN!  \r\n \r\n  \r\nSANA DALGALARDAN KALEM YAPTIM VE KIYIYA SENI SEVIYORUM YAZDIM, SEN DE INANDIN DEGIL MI? SEN DELISIN, SENI SEVMEDIM, SANA BAGLANDIM SANA TAPTIM.  \r\n \r\n  \r\nSEN GUNESIN DOGDUGU, KARANLIGIN BITTIGI YERDESIN SEN HEP KALBIMDE YATAN TEK SEVGILIMSIN. SEVGILILER GUNUN KUTLU OLSUN');
INSERT INTO `phpbb_posts_text` VALUES (411, '6d8874a238', 'SEVG', 'HAYATTA IKI KOR TANIYORUM BIRINCISI SENDEN BASKASINI GORMEYEN BEN,IKINCISI BENI GOREMEYEN SEN....  \r\n \r\n  \r\nSEN HIC DENIZLERIN DIBINE BAKINCA YEMYESIL ORMANLARI GORDUN MU?IMKANSIZ DEME!CUNKU BEN SENIN GOZLERINE BAKINCA OLULERIN BILE SAHIT OLMADIGI O CENNETI GORDUM.  \r\n \r\n  \r\nBIR GECE AY BANA SORDU ''NEDEN SENI AGLATAN BIR KIZLA BERABERSIN? AYA BAKTIM VE DEDIMKI'' SEN HIC GOKYUZUNDEN VAZGECEBILIRMISIN...  \r\n \r\n  \r\nBIRINE VERILECEK DEGER,UGRUNA FEDA EDILEBILECEKLERLE OLCULEBILIYORSA AC GOZLERINI ETRAFINA BAK.GORDUGUN HERSEYI FEDA EDEBILIRIM.AMA SAKIN AYNAYA BAKMA...  \r\n \r\n  \r\nSENI COK OZLEDIM. SENI HER OZLEDIGIMDE KALBIME BIR YILDIZ CIZDIM. SENI NE KADAR OZLEDIGIMI BILMEK ISTERMISIN? SAYENDE BIR GOKYUZUNE SAHIBIM CANIM!!  \r\n \r\n  \r\nKORKMA SAKIN GECELERDEN PENCERENDE YILDIZ GIBI PARLAYACAGIM, UZAKLARDA YALNIZSIN SANMA SAKIN,NEFES GIBI ICINDE,GOLGEN GIBI ARKANDA, CAN GIBI CANINDAYIM BEBEGIM...  \r\n \r\n  \r\nNE OLUR GITME ELVEDA DEME BEN SENSIZ KADERIMLE NE YAPARIM SOYLE ERIYORUM SESSIZCE OLUYORUM GITGIDE OZLEM VAR AMA CARE YOK SEVGIME  \r\n \r\n  \r\nASLA SEVME,SEVERSEN IHANET ETMEIHANET EDENI DE ASLA AFFETME!!  \r\n \r\n  \r\nGULU BIR GUN, SENI HERGUN, GULU SOLUNCAYA, SENI OLUNCEYE DEK SEVECEYIM...  \r\n \r\n  \r\nALIP KIRSALAR KALEMIMI KANIMLA YAZARIM SENI SEVDIGIMI...  \r\n \r\n  \r\nSU DINMEYEN ARZUYA KARSI KOYSADA DAGLAR,UMITSIZCE GOZLERIM SANMAKI HERDEM AGLARVARSINDA HASRET ILE GECIVERSIN SENELER,BIZI AYIRAN YOLLAR BIRGUN YENIDEN BAGLAR...  \r\n \r\n  \r\nBIRLIKTE YASABILECEGIN BIRIYLE DEGIL ONSUZ YASAYAMAYACAGIN BIRIYLE OL.GELDIGINDE BOSLUK DOLDURANLA DEGIL GITTIGINDE YERI DOLMAYANLARDAN OLSUN...  \r\n \r\n  \r\nYASIYORSAM, ICIMDE HALA BIR UMUT VARSA SENI OZLEDIGIM ICIN ...  \r\n \r\n  \r\nGECEYE INAT SENINLE SABAHLAYACAGIM,GUNES KISKANSIN SENINLE ISINACAGIM,YASTIKLAR AGLASIN GOGSUNDE UYUYACAGIM,BUNDAN SONRA HEP SANA BAGLI KALACAGIM...  \r\n \r\n  \r\nSEN GITTIN SACLARIMA ERIMEZ KARLAR YAGDI MEVSIMLERIN TADI YOK BAHARIM SENDE KALDI...  \r\n \r\n  \r\nALLAHIM BENI OYLE BIR SON BAHAR AYAZINDA OLDUR KI, SEVDIGIM MEZARIMA KOYACAK TEK BIR GUL BILE BULAMASIN...  \r\n \r\n  \r\nSANA SON YALANIMI SON NEFESIMDE SOYLEYECEGIM, SIRF SANA INAT OLSUN DIYE SENI SEVMIYORUM DIYECEGIM...  \r\n \r\n  \r\nMUTLU OLMAK ISTIYORSAN ASLA BEKLEME CUNKUO HIC BIR ZAMAN GELMEZ...  \r\n \r\n  \r\nKALBIM SENI SEVMEYECEK KADAR ADI ISE ELLERIM ONU PARCALACAK KADAL ASIL DIR...  \r\n \r\n  \r\nHER HATIRLAYIS EVVELINDE UNUTMAYI SAKLAR BILIR MISIN?VE BILIR MISIN BEN SENI BIR DEM OLSUN UNUTMADIM!...  \r\n \r\n  \r\nYAGMURLU BIR GUNDE YATAGINA UZANIP HAYALINI KURDUGUN VE KESKE DEDIGIN BUTUN GUZELLIKLER SENIN OLSUN...  \r\n \r\n  \r\nDUNYAN OYLE BIR KARARSIN KI, SENI AYDINLATAN TEK ISIK GOZLERIM OLSUN...  \r\n \r\n  \r\nSEVGI, LAPA LAPA KAR YAGAN BIR GUNDE BIR CATI SACAGI ALTINA SAKLANAN BIR SERCENIN KOPAN TUYUNUN ASAGIYA DUSUSUNU FARKEDEBILMEKTIR...  \r\n \r\n  \r\nSEVGICURUMEYE YUZ TUTMUS TENEKE UYGARLIGININ KIRIK AYNASINDAN BIR GULUCUK KIVILCIMI GOREBILMEKTIR..  \r\n \r\n  \r\nGERCEKTEN SEVGI INSANIN DUNYADAKI EN DEGERLI VE EN GUCLU SEYIYMIS. OYLEKI INSANA HERSEYI YAPABILIYOR, OLUME BILE GOTUREBILIYOR.  \r\n TATLI BIRI VARDI SEVILMEYE DEGER GUZEL BIRI VARDI, GORULMEYE DEGER, IYI DOSTLAR VARDI OZLEMEYE DEGER. AMA BIRI VARDI KI CAN VERMEYE DEGER TABII KI ANLARSA EGER!  \r\n \r\n  \r\nBENI KALBINDE KURSUN YARASI DEGIL,AVUCUNDA MUTLULUK, GOZBEBEGINDE SEVINC OLARAK TASI, CUNKU BIZ UNUTMAK ICIN SEVMEYIZ BIR TANRIYI BIR DE SEVDAMIZI ASLA UNUTMAYIZ!  \r\n \r\n  \r\nDUN CICEKCININ ONUNDE BIR GUL GORDUM, DUNYANIN EN GUZEL GULU BENIM DIYE HAYKIRIYORDU.O GULU ALDIM, AMA EN GUZEL GUL OLDUGU ICIN DEGIL...SENI GORUP UTANSIN DIYE!...  \r\n \r\n  \r\nHATIRINA DAGLAR DIZ COKSUN SEN EGILME SAKIN, AYRILIK, HUZUN NEDIR SEN BILME SAKIN, BU GONUL BAHCESINDEN KIM GIDERSE GITSIN SEN GITME SAKIN!  \r\n \r\n  \r\nRUHUMU YERE VURUP HASRET CEKTIREN OLSANDA,NE SEVGINE BEDDUAM, NE SANA KINIM VAR.DERYAYA AKAR GIBI BINBIR DERTLE OLSAMDA, SENI MAHSERE KADAR SEVMEYE YEMINIM VAR...  \r\n \r\n  \r\nDENIZLERDEN KAGIT, DAGLARDAN KALEM YAPTIM. SANA BIN DEFA &quot;SENI SEVIYORUM&quot; YAZDIM. APTALSIN BANA INANDIN. BEN SENI SEVMEDIM, SANA TAPTIM...  \r\n \r\n  \r\nELLERRIN UCURUM KENARINDA ACAN CICEK GIBI. DOKUNMAK ISTESEM DUSSERIM DIYE DEGIL. DUSERKEN ELIMI BIRAKAMAM DIYE KORKARIM.  \r\n \r\n  \r\nHO ! ICIMIN GUZEL ATI SENI HEP UCURUMLARA SURDUM OLANAKSIZ ARAYISA, CILGIN SULARA, ZAMAN KAYALARINA HO! BENIM KARA, EVRENSEL ISILTIM SENI SANA BENZEYEN FIRTINAYA SURDUM.  \r\n \r\n  \r\nSENDE YUREGINDE ISIT SIIRLERINI YUREGININ IRMAKLARIN DA YESERT BIRAK ORADA KALSINLAR &quot;BIR GUN MUTLAKA&quot; SENINDE HAYKIRACAK CIGLIKLARINDA SIIRLERIN TASACAK YASAM DENEN UZANTIDA  \r\n \r\n  \r\nBILIRMISIN GECELER NEKADAR UZUN GELIR BEKLEYENLERE HELE O BEKLENENLER VAZ GECILMEZLERDENSE...  \r\n \r\n  \r\nSEVIYORUM AMA KIMI EN TATLI BIRISINI NASIL ANLATSAM SANA ILK HARFINE AKSANA (SENI) \r\n \r\n  \r\nKARANLIK HUCRELERDE PASLANMIS KANCALARDA KUDURMUS PENCELERDE ISKENCEDE KAN ICINDE NICE GUNUM NICE GECEM...????  \r\n \r\n  \r\nHANI KARDELEN GOKYUZUNE ASIK OLUPTA CIKARIRYA NARIN GOVDESINI KARIN ALTINDAN. ZEMHERI YUREGIM DER KI YUREGINDE KARDELEN KADAR CESARETIN YOKSA ASLA ASIK OLMA...  \r\n \r\n  \r\nGULLE BAHCESINDE BIR GUL OLSAN SENIN USTUNE GUL KOKLAMAM GULUMGULU SEVEN DIKENINE KATLANIR DERLER ,BIR TEK SENIN AYRILIGINA DAYANAMAM...  \r\n \r\n  \r\nHER MUTLULUK BIR KUM TANESI ISE BUTUN SAHILLER SENIN OLSUN...  \r\n \r\n  \r\nSENKI BENI CIZEMEDIN ERGUAN KOKULU DUSLERININ TUALINE BIR HAYEL BILE OLAMADIM GOZLERINDEKI YANLIZLIK UCGENINDE...  \r\n \r\n  \r\nBIR KUS KADAR OZGUR BIR BEBEK KADAR MASUM DUYGULARLA SEVDIM SENI...  \r\n \r\n  \r\nBIR BAKIS BIR ASKI,BIR SK BIR OMRU BIR OMUR BIN ACIYI DOGURUR...  \r\n \r\n  \r\nSENI SEVMEK DUNYANIN EN GUZEL SESINDE SARKI DINLEMEYE BENZIYOR,AMA BEN SARKI DINLEMEK DEGIL SARKI SOYLEMEK ISTIYORUM...  \r\n \r\n  \r\nBOYLE BASIT BIR DUNYADA SEN BENIM ICIN COK OZELSIN...  \r\n \r\n  \r\nSENI SEVDIGIM KADAR YASASAYDIM OLUMSUZLUGUN ADINI ASK KOYARDIM...  \r\n \r\n  \r\nKUL OLMUS ATES YANARMI?BUZ TUTMUS SU AKARMI?BU GOZLER SENI SEVDI BASKASINA BAKARMI...  \r\n \r\n  \r\nSENISEVIYORUM DIYENIN SEVGISINDEN SUPHE ET CUNKU ASK SESSIZ SEVGI DILSIZDIR...  \r\n \r\n  \r\nBIR GUL OLMAK ISTERDIM, DALIMDAN KOPTUGUM AN YALNIZ SENIN ICIN KOPAYIM VE YALNIZ SENIN AVUCLARINDA SOLAYIM DIYE BIRTANEM...  \r\n \r\n  \r\nSEN RUYALARIN EN GUZELINI GORURUKEN TANRININ SENI KORUMASI ICIN GONDERDIGI MELEGIN KANATLARI O KADAR BUYUK OLSUNKI SANA KIMSE DOKUNAMASIN...  \r\n \r\n  INSANLAR HEP BIRILERININ PESINDEN KOSARLAR, AMA DONUPTE KENDI PESLERINDEN KOSANLARA HIC BAKMAZLAR...  \r\n \r\n  \r\nYASTIGIMLA UYKUMU BASBASA BIRAKTIM,SIRF SENINLE YANLIZ KALABILMEK ICIN!BU DA YETMEDI KENDIMIDE BIR KENARA BIRAKTIM SIMDI BURDA YANLIZ SEN VARSIN...  \r\n \r\n  \r\nBIR GUN ZAMAN KAYAR ELLERINDEN TUTAMAZSIN. SEL GIBI AKAN YASLARINI KURUTAMAZSIN, OYLESINE BENDESIN VE OYLESINE SENDEYIMKI ARTIK UNUTMAK ISTESENDE UNUTAMAZSIN...  \r\n \r\n  \r\nERKEKLER AGLAMAZ DERLER EGER GOZ YASLARIM DENIZE DOKULSEYDI SAHILE VURAN DALGALAR SENI SEVIYORUM YAZARDI...  \r\n \r\n  \r\nSEVEN SEVGIYI BIR TUTAM BAHAR SANAR, CICEKLERIN ACTIGINA KANAR SEVILEN ISE MEVSIMI YAZ BULUR, GUNESIN HER ZAMAN GULDUGUNU GORUR. BU ASK TA KIS MEVSIMINE VARIR, SEVEN SEVILENE YA ULASIR YA DA ULASMAZ...  \r\n \r\n  \r\nDUSLERIM VARDI GORMEKTEN KORKTUGUM,HISLERIM VARDI SOGLEMEKTEN KORKTUGUM,SIIRLERIM VARDI YAZMAKTAN KORKTUGUM,SIMDI SEN VARSIN KAYBETMEKTEN KORKTUGUM...  \r\n \r\n  \r\nUZAK DIYARLARDAN GELDIM,SENI GORMEYE YEMIN ETTIM,BIR OMUR SENI SEVMEYE.SENSIZ BIR DUNYA BENIM NEYIME?YA BENI SEV VERME ELLERE YADA AT BILINMEZ YERLERE...  \r\n \r\n  \r\nRUYALARINI GUL YAPRAKLARIYLA,YATAGINI PAPATYALARLA SUSLEDIM.UZERINI SEVGIYLE ORTUP TUM KABUSLARINI ALDIM KI EN GUZEL RUYALARI SEN GORESIN...  \r\n \r\n  \r\nFATIHIN ONUNE ISTANBUL''U CIKARAN KADER, GONLUNU FETHEDEYIM DIYE KARSIMA SENI CIKARDI,AMA GEL GORKI SENIN GONLUNU FETHETMEK ISTANBUL''U FETHETMEKTEN DAHADA ZORMUS BILEMEMISIM...  \r\n \r\n  \r\nHAYATTA IKI SEYE ONEM VERIRIM BIRISI OZGURLUGUM DIYERI ISE SEN...OZGURLUGUM ICIN CANIMI VERIRIM...SENIN ICIN ISE OZGURLUGUMU SEVE SEVE VERIRIM...  \r\n \r\n  \r\nYANLIZ,GECELERIN,UMIT,BEKLEYENLERIN,HAYAL,CARESIZLERIN,YAGMUR, SOKAKLARIN, TEBESSUM, DUDAKLARIN,SEN ISE YALNIZ BENIMSIN BIRTANEM...  \r\n \r\n  \r\nSENI TANIMADAN ONCE BEN BEN DEGILDIM,SENI TANIDIKTAN SONRA BENDEKI BENSIZLIGIN SENSIZLIK OLDUGUNU ANLADIM...  \r\n \r\n  \r\nSURGUN BU SEVDANIN UMUTLARI,OLMAYACAK DAGLARI SARSAN KURSUNI BAKISLARI,ARTIK SARAMAZ BENI BU SEVDANIN ALCILI KOLLARI...  \r\n \r\n  \r\nGULU SEVKI DIKENI BATMASIN,OYLE BIRINI SEVKI,SENI ALDATMASIN.SEV AMA ALDANMA SEVIL AMA ALDATMA,BILMIYORSAN SEVMEYI TASIMA O YUREGI...  \r\n \r\n  \r\nGOKYUZUNDEKI BUTUN YILDIZLARI TOPLASAN BIRTEK SEN ETMEZ, FAKAT BIRTEK SEN HEPSINE BEDELSIN...  \r\n \r\n  \r\nASKIMIZIN SUYA DUSECEGINI BILSEYDIM , BALIK OLURDUM...  \r\n \r\n  \r\nBEN HICBIR ZAMAN YANLIZ OLMADIM,YANIMDAKI UMITSIZ ASKIM BENIM TEK ARKADASIM OLDU...  \r\n \r\n  \r\nNE SEVGILER GOMDUM YUREGIME YALNIZCA ADLARI SEVGIYDI VE OYLE BIR SEVGI GOMDUM KI YERI YALNIZCA BENIM YUREGIMDI.ONU NE GOMEBILDIM, NE SILEBILDIM. BU SEVGI SANA AITTI...  \r\n \r\n  \r\nBIR GUN CEHENNEMDE KARSILASABILIRIZ.SEN KALP HIRSIZI OLDUGUN ICIN,BENSE TANRIYI BIRAKIP SANA TAPTIGIM ICIN...  \r\n \r\n  \r\nBULUTLARA DEPOLADIM OZLEMINI,RUZGARLA YOLLADIM SEVGIMI,KUCUK MELEKLER GONDERDIM.PEKI SENI OPMEYE GELDILER MI?...  \r\n \r\n  \r\nAYNAYA HER BAKTIGINDA SENI DEGIL SENI DUSUNMEKTEN SEN OLMUS BENI GORMENI ISTIYORUM...  \r\n \r\n  \r\nSEVGIDIR HER KAPIYI ACAN BIZI BAZEN BIR KUS BAZEN BIR CICEK YAPAN HER KOTU SEY AMA HER KOTU SEY UNUTULUR SENI SEVIYORUM DIYEBILIYORSAN...  \r\n \r\n  \r\nYARI DALGALI OLMAMALI DENIZ YA TAM DURULMALI YA DA KUDURMALI YARI UMIT VERMEMELI SEVGILIYE YA TAM SEVMELI YA DA CEKIP GITMELI');
INSERT INTO `phpbb_posts_text` VALUES (412, 'f27d18b8c4', 'GalataSaray', 'BELKI BIR GUN BASKALARI DA SUPER KUPA''YI KAZANIR.. NE DERSINIZ HOS OLMAZ MI?  \r\n \r\n  \r\nCIMBOMLU ARKADASLAR..FENERLILER BIZE MUTESEKKIR..BIZ OLMASAK AVRUPA TAKIMLARINI SEYREDEMEYECEKLER...  \r\n \r\n  \r\n1905 TE DOGDU ASKIMIZ ,SARI KIRMIZI AKAR KANIMIZ,CIMBOMBOM FEDA OLSUN SANA CANIMIZ OLENE KADAR HEP SENIN YANINDAYIZ  \r\n \r\n  \r\nBIZ ALISTIK AVRUPADA KUPA GORMEYE, SIRA SENDE FENERBAHCE. BULGARISTANDA YAYLA KUPASI VARMIS, HAYDI FENERE DE BIR ALKIS.  \r\n \r\n  \r\nAVRUPA FATIHISIN GALATASARAY..TURKIYENIN GURURUSUN GALATASARAY.. GOKTE YILDIZSIN GONULLERDE AY, BU SENEDE SAMPIYONSUN GALATASARAY..  \r\n \r\n  \r\nCIMBOMBOM DIYEREK SANA YUZ KOYDUK,SARININ YANINA KIRMIZI KOYDUK,YILLARDAN BERIDIR HEP SENIN OLDUK,CIMBOMBOM SEN BIZIM HERSEYIMIZSIN  \r\n \r\n  \r\nCIM BOM BOM''UM BENIM BIRICIK SEVGILIM, SOYLE SENDEN BASKA KIMIM VAR BENIM, SENINLE AGLARIM SENINLE GULERIM, SOYLE SENDEN BASKA KIMIM VAR BENIM.  \r\n \r\n  \r\nASLAN TERBIYE EDEN FENERBAHCELI TARAFTARIN NE HALE GELDIGINI BIRAK TURKIYEYI DUNYA GORDU. SEN KI KUCUK BIR KANARYASIN ASLANLA UGRASMAK SENIN NEYINE..  \r\n \r\n  \r\nISTERSEN EGLENELIM DAVULLARLA ZURNALARLA. ISTERSEN GIRISELIM ZINCIRLERLE SOPALARLA... LAYLAY LAYLAY LAYLAY..  \r\n \r\n  \r\nNASIL KI BU MILLETIN TACIDIR YILDIZLA AY,YUKSEL TAA ARSA KADAR SANLI GALATASARAY...  \r\n \r\n  \r\nSAPSARIYLA KIRMIZI KALBIMIZIN YILDIZI ,SAMPIYON OL CIMBOMBOM AL BIZIM CANIMIZI...  \r\n \r\n  \r\nFENERLI OLMAK AYIP DEGIL, YETERKI CAKTIRMA..  \r\n \r\n  \r\nADANA CEYHAN HERKES CIMBOMLU HADE SENDE UYAN ..  \r\n \r\n  \r\nKALPLERDE YILDIZ,GONULLERDE AY, SAMPIYONSUN GALATASARAY  \r\n \r\n  \r\nBIZ GONULLERE CEKTIK BAYRAKLARI DIREKLERE DEGIL. BIZ TARIHE YAZDIK ISMIMIZI DUVARLARA DEGIL. BIZ AVRUPADA ACTIK BAYRAGI KADIKOYDE DEGIL. BIZ DUNYAYA POZ VERDIK SAKSAKCILARA DEGIL. VE BIZ IMPARATORLARLA BUYUDUK KESTANELERLE DEGIL.  \r\n \r\n  \r\nERKEK ADAM KANATLI TAKIM TUTMAZ. KUKRE GALATASARAYIM');
INSERT INTO `phpbb_posts_text` VALUES (413, '1ebcee37a0', 'AYRILIK', 'EGER HAYATTAN BIKIP OLUME DOGRU SESIZCE YURUMEK ISTERSEN YANIMA GELKI SANA SENSIZLIGIN OLUM OLDUGUNU GOSTEREYIM...  \r\n \r\n  \r\nBELIM BUKUYOR BOYLE AYRILIK. VERDIGIN ACILAR HASRET TANIDIK. GORMEDIM KI BIR GUN SENDEN YAKINLIK. DONMESENDE GERI FARKETMEZ ARTIK...  \r\n \r\n  \r\nTUTULMUSUM BIR ESMERIN YAKICI GOZLERINE NEDEN SONRA ANLADIM BUTUN BUNLAR HEP HAYALMIS TAS BASTIRDIM GOGSUME BIR SEVGILI YERINE...  \r\n \r\n  \r\nKESKE YANLIZLIGIM KADAR YANIMDA OLSAYDIN! KESKE YANLIZLIGIMLA PAYLASTIGIMI SENINLE PAYLASSAYDIM! KESKE SENIN ADIN YANLIZLIK OLSAYDI VE BEN HEP YANLIZ KALSAYDIM!!!  \r\n \r\n  \r\nHEP KALANLARA GIDENLERI KATTIM! BIR GUN YERINE GECEMEDILER. O KALANLARA GIDENLERI KATTIM YINE BIR TANE SEN EDEMEDILER. ZOR GELDI AYRILIK ALISAMADIM.  \r\n \r\n  \r\nSILINIR DIYORLAR EN ACI IZLER, BITERMIS KISLARIM GELIRMIS YAZLAR, BILMEZLER SU GONLUM DERINDEN SIZLER, UNUTURSUN DIYE SOYLEMEK KOLAY...  \r\n \r\n  \r\nFIKRINDEN GECELER YATABILMIREM BU FIKRI BASIMDAN ATABILMIREM NEYLEYIMKI SENE CATA BILMIREM AYRILIK AYRILIK AYRILIK...  \r\n \r\n  \r\nUNUTMAK ZOR ANLATMAKSA IMKANSIZ CUNKU SEN UNUTTUKCA HATIRLANAN VEDE ANLATTIKCA BITMEYENSIN. BITANEM. SENI SEVIYORUM...  \r\n \r\n  \r\nDUNYA BIR EFSANE HAYAT BIR DRAM YASAM BIR HUZUN SEVMEK BIR HATA...  \r\n \r\n  \r\nUMUDA KURSUN SIKSADA OLUM, UNUTMA UMUDA KURSUN ISLEMEZ...  \r\n \r\n  \r\nDON CAREM EL GIBI UZAK DURMA DOKUNUR GURURUMA BU YABANCI HALLERIN...  \r\n \r\n  \r\nBELKI ANLAMADIGIM BI HIS,BELKI SANA KIZAMADIGIMIN BELGESI, BELKIDE SAMIMIYETI YANLIS ZAMANDA YANLIS INSANDA ARAMANIN CARESIZ ANLATILISI IDI...  \r\n \r\n  \r\nSENI BIRAKIYORUM BIR ELVEDA BILE DIYEMEDEN, SENI SEVIYORUM, SENI BILE GOREMEDEN...  \r\n \r\n  \r\nNEZAMAN SAGIR BIR RESSAM KIRISTAL BIR ZEMIN UZERINE DUSEN GULUN CIKARDIGI SESIN RESMINI YAPARSA ISTE O ZAMAN BEN SENDEN VAZGECERIM...  \r\n \r\n  \r\nSENSIZ KALDIGIM ILK GUNDEN BERI ICIMDE BIR UMUT VUSLATA DAIR. AKSAMLARI IMZALADIM GOZYASLARIMLA.SENI ARAMIYOR SENI SORMUYORSAM BUM SENDEN VAZGECTIM DEMEK DEGILDIR BIRDAHA BOYLE SEVECEK OLSAM BIR KALEMDE SILERDIM SENI...  \r\n \r\n  \r\nSENSIZLIK HAYAT DENEN DEFTERIN ZINDAN KARASI YAPRAKLARINA HASRET KIRMIZISIYLA MULTECI HUZUNLER YAZMAK GIB ASKIMM...  \r\n \r\n  \r\nYAZDIGIM HER CUMLE AGLIYOR.  \r\n \r\n  \r\nACIYI HISSETMIYORUM. SEVMEYI BECEREMIYORUM. CARESIZLIK HIC BITMEYEN BIR SENFONI SENSIZ...  \r\n \r\n  \r\nHAYATTA 4 YANLIS YAPTIM DOGMAK YASAMAK BUYUMEK VE UMUTLARA SARILMAK 1 TEK DOGRU YAPTIM O DA SENI SEVMEK AMA UNUTMUSUM GUZELIM 4 YANLIS 1 DOGRUYU GOTURDU.  \r\n \r\n  \r\nGERCEK GULUSLER SANA SANA UMUTLAR, MUTLULUKLAR SANA. SANA YAZ,SANA BAHAR RENGARENK CICEKLER BANA YALNIZLIK, KIS, KAR VE SAHTE GULUSLER YETER !..  \r\n \r\n  \r\nNASILKI SENSIZLIGI BEN YARATMADIYSAM YASAYACAGIN BENSIZLIKTE BENIM ESERIM OLMAYACAK UZULME UZULURSEN YILLARIN SENDEN ALACAGI TEK SEY GENCLIGIN OLACAKTIR...  \r\n \r\n  \r\nBIR KARANLIK GELIYOR YOKLUGUNUN ARDINDAN. NE ZAMAN GUNE$ BATSA BU SON GECEM DIYORUM. VAZGEC YALAN DUNYANIN KOHNE SALTANATINDAN. YETI$IR BUNCA KEDER BUNCA ELEM DIYORUM. BU NE BITMEZ AYRILIK, BU NE BITMEZ OZLEM DIYORUM.  \r\n \r\n  \r\nBEN SENI BIR NOKTADAN GECEN DOGRULAR KADAR SEVDIM,SEN BENI IKI NOKTADAN GECEN DOGRU KADAR ANLADIN...  \r\n \r\n  \r\nASK KARSINDAKINI BULUNMAZ HINT KUMASI SANMAKLA HIYARIN TEKI OLDUGUNU ANLAMAN ARASINDAKI ZAMANDIR.  \r\n \r\n  \r\nHADI GIT BIRAK BENI ESKI KISIMDA YARINLARIMI ALDA GIT OMRUM BOYUNCA YASIYACAGIM UNUTULUSLARI, HUZUNLERIVE OLUMLERI BIRAK VE GIT..  \r\n \r\n  \r\nRUZGAR OZUR DILESEDE DAL KIRILDI BIR KERE...  \r\n \r\n  \r\nSEN SOZLERIME ALDIRMA,GOZLERIN ZAMANSIZ ISLANMASIN,GUNESIN NERDEN DOGDUGUNU BILIRSIN VE SENI NASIL SEVDIGIMI DE BILIRSIN EGER BITSIN DIYORSAR YINEDE SEN BILIRSIN..!  \r\n \r\n  \r\nSENIN YOKLUGUN CEHENNEMIN OBUR ADI NE OLUR GITME USUYORUM...  \r\n \r\n  \r\nHAYAT HICBIR INSAN ICIN AGLAMAYA DEGMEZ.ZATEN DEGEN INSAN AGLATMAZ.YINE DE AGLAMAK ISTIYORSAN,BASINI DIK TUT KI GOZYASLARIN AGLATAN KADAR ALCALMASIN.SANA SEVGIMI SOYLESEM SEVGIMDEN KORKARSIN.BEN SENIN ICIN OLMASAM BILE SEN BENIM ICIN HEP VARSIN...  \r\n \r\n  \r\nBIR COCUK GULUSUNDE, RUZGARIN EN CAPKIN OPUSUNDE, YAGMURUN HER SACINA DUSUSUNDE BENI HATIRLA....  \r\n \r\n  \r\nEGER BENI BU SOKAKTA, BU MAHALLEDE, BU SEHIRDE BULAMAZSAN,SEVGILIM BILKI BEN, GOZLERININ DALDIGI YERDEYIM.  \r\n \r\n  \r\nBASKALARINA KENDINDEN FAZLA DEGER VERME.YA ONU KAYBEDERSIN, YA DA KENDINI MAHVEDERSIN.  \r\n \r\n  \r\nSEVME BENI, HATIRLA.OZLEME BENI AMA UNUTMA.  \r\n \r\n  \r\nSEHRIMIN BENSIZ SOKAKLARINI ADIMLARKEN,BEN SENSIZLIGIMIN SOKAKLARINDA BIR SEHIR KURUYORUM KENDIME.  \r\n \r\n  \r\nSEN BENIM OLMADIN HICBIR ZAMAN, BEN SENINIM AMA DAIMA.SENDEKI YOKLUGUM YOK EDEMEDI BENDEKI VARLIGINI.YUREGIM SEVGI, YUREGIM OZLEM DOLU.  \r\n \r\n  \r\nGUNES BATMADAN YILDIZLAR GORUNMEZ ELBET,GELECEK GUNLSER NE ALIR NE VERIR BILEMEM,BILDIGIM SARKILAR BITEN ASKLARIN CENAZE TORENLERIDIR.BIR SARKI SOYLE GOM GITSIN,GOM GITSIN YALANLARI GOM GITSIN YALNIZLIGI,GOM GITSIN ACILARI.SONRADA OTUR YUREGIN YESERENE KADAR \r\n \r\n  BEYAZ GELINLIGI GIYMIS USTUNE NE GUZEL YAKISMIS ESMER TENINE SIYAH SURMELERI CEKMIS GOZUNE YARIMI ELLERE GELIN ETMISLER.  \r\n \r\n  \r\nYARIMI ELLERE GELIN ETMISLER SURATINI ASMIS GULMEK ISTEMEZ DUSUNUR DERDINI KIMSEYE DEMEZ EVINI BIRAKIP GITMEK ISTEMEZ YARIMI ELLERE GELIN ETMISLER \r\n \r\n  \r\nSABRET SABRET INCI TANEM BEKLE BENI GELECEGIM ELBET SABRET.... \r\n \r\n  \r\nOLDUR BENI YASAMAYI ISTEMIYORUM.SENDEN AYRI BU CILEYI CEKEMIYORUM. \r\n \r\n  \r\nACI CEKMEK OZGURLUKSE, OZGURUZ IKIMIZDE, O YUVASIZ CALIKUSU, BEN ISE KAFESTE KANARYA... \r\n \r\n  \r\nHASRETINDEN OLSEM, KAPINI CALAN OLMAZDIM, BIR DAMLA YAS OLSAM, GOZUNDE DONAR AKMAZDIM, ADINI SEVGI OLSA, KALBIMDEN SOKER ATARDIM,... \r\n \r\n  \r\nGAMZE GAMZE GULUVER SIMDI BENI GOYSUNE ALI VER SIMDI MEVSIMI GELDI ASKIN BENIMLE BIR BUTUN OLU VER SIMDI...  \r\n \r\n  \r\nHAYKIRACAK NEFESIM KALMASA BILE! ELLERIM UZANIR OLDUGUN YERE! GOZLERIM GORMESEDE BULURUM YINE! KALBIM DURMUSSA INAN CARPAR SENINLE...  \r\n \r\n  \r\nSERSERIM BENIM DELI DOLU SEVGILIM KOR GIBI SICAK YADA SULAR GIBI SERIN GELME UZAK DUR KORKUYORUM COK CILGINLIK BU HALIM YOK...  \r\n \r\n  \r\nKALBIM DURAKSIZ HAYKIRISLARDA NE YAPSAM AYRILAMAM SENDEN ASLA HAFIFE ALMA ASK VURUR INSANA BU KADAR KOLAY SANMA DELIKANLIM...  \r\n \r\n  \r\nAH AKSAMLAR OZLEMIM BITMIYOR, AH YAGMURLAR GOZ YASIM DINMIYOR, AH GECELER SABAHLAR OLMUYOR AH!  \r\n \r\n  \r\nGUCENMEDIYSEN KIRILMADIYSAN DARILMADIYSAN DON.NASIB OLURDA BENI BULURSAN HESAP SORARSAN SOR, GULUM MU DERSIN OLUM MU DERSIN YETERKI SES GELSIN, BILIRIM SENIN ICIN YANARIM.  \r\n \r\n  \r\nASKIM ASKIM DIYE AGLAYACAKSIN, BASINI YASTIKLARA BOS KOYACAKSIN, SESINI DUYAN YOK KI ANLAYACAKSIN, SEN GITTIN SIRA BENDE, BEN BITTIM SIRA BENDE.  \r\n \r\n  \r\nINSANLARIN YUZLERINI GOREMIYORUM.BOGAZIM DUGUM DUGUM COZEMIYORUM, ISTESENDE YANINA GELEMIYORUM. TUTSAM SU KARANLIGI, TUTSAMDA YIRTSAM. AH ELIM TUTUSMUSSA, ELINI TUTSAM SUSMASAN KONUSSAN SESINI DUYSAM, TUTSAM GUZEL YUZUNU BAGRIMA BASSAM.  \r\n \r\n  \r\nBEN SENDE TUTUKLU KALDIM, KENDI HAYATIMDAN CALDIM, YEDI CIHAN DOLANDIM, BANAMISIN DEMIYOR. SAKLADIM GOZLERIMI SUSTUM HEP SOZLERIMI YANDIM YAR KOZLERIMI AH SAVUR SAVUR BITMIYOR.  \r\n \r\n  \r\nBEN SENIN HAYATINDAN GITTIM OGLUM, HADI YERIME KOY BIRINI KOYABILIRSEN, BEN SENIN HAYATINDAN GITTIM OGLUM, HADI DUR SARI ODALARDA DURABILIRSEN.  \r\n \r\n  \r\nOLURUM YOLUNA, OLURUM DE YINE BOYUN EGMEM, YAKARIM DUNYAYI UGRUNA AMA SANA EGILMEM, OYLE SINIRSIZ, OYLE DERIN, OYLE COK SEVERIM KI KORKARSIN. KURUYO COLE DONSEMDE, PARE PARE OLSAMDA YENILMEM. \r\n \r\n  \r\nBENI YAK, KENDINI YAK, HERSEYI YAK. BIR KIVILCIM YETER, BEN HAZIRIM BAK. ISTER OP, OKSA ISTERSEN OLDUR. ASK ICIN OLMELI, ASK O ZAMAN ASK! \r\n \r\n  \r\nGIDIYORUM BUTUN ASKLAR YUREGIMDE GIDIYORUM KOKUN HALA UZERIMDE, SANA KORKULAR BIRAKTIM BIR DE YENI BASLANGICLAR BIR KENDIM BIR BEN GIDIYORUM.  \r\n \r\n  \r\nNIKAHINA BENI CAGIR SEVGILIM, ISTERSEN SAHIDIN OLURUM SENIN BU ADAM KIM DIYE SORAN OLURSA ESKI BIR TANIDIK DERSIN SEVGILIM...  \r\n \r\n  \r\nHEY BAKISI SEVDALI, HEY DURUSU YARALI, SENI KIMDEN SORMALI, SENI ASKA YAZMALI...  \r\n \r\n  \r\nASKI SANDIKLARA KALDIRDIM, USTUNE YUKLER YUKLEDIM, ACMASIN KIMSELER DIYE KILITLERINE KILIT EKLEDIM. SENI COK OZLUYORUM \r\n \r\n \r\n \r\n \r\n \r\n\r\n \r\nEGER HAYATTAN BIKIP OLUME DOGRU SESIZCE YURUMEK ISTERSEN YANIMA GELKI SANA SENSIZLIGIN OLUM OLDUGUNU GOSTEREYIM...  \r\n \r\n  \r\nBELIM BUKUYOR BOYLE AYRILIK. VERDIGIN ACILAR HASRET TANIDIK. GORMEDIM KI BIR GUN SENDEN YAKINLIK. DONMESENDE GERI FARKETMEZ ARTIK...  \r\n \r\n  \r\nTUTULMUSUM BIR ESMERIN YAKICI GOZLERINE NEDEN SONRA ANLADIM BUTUN BUNLAR HEP HAYALMIS TAS BASTIRDIM GOGSUME BIR SEVGILI YERINE...  \r\n \r\n  \r\nKESKE YANLIZLIGIM KADAR YANIMDA OLSAYDIN! KESKE YANLIZLIGIMLA PAYLASTIGIMI SENINLE PAYLASSAYDIM! KESKE SENIN ADIN YANLIZLIK OLSAYDI VE BEN HEP YANLIZ KALSAYDIM!!!  \r\n \r\n  \r\nHEP KALANLARA GIDENLERI KATTIM! BIR GUN YERINE GECEMEDILER. O KALANLARA GIDENLERI KATTIM YINE BIR TANE SEN EDEMEDILER. ZOR GELDI AYRILIK ALISAMADIM.  \r\n \r\n  \r\nSILINIR DIYORLAR EN ACI IZLER, BITERMIS KISLARIM GELIRMIS YAZLAR, BILMEZLER SU GONLUM DERINDEN SIZLER, UNUTURSUN DIYE SOYLEMEK KOLAY...  \r\n \r\n  \r\nFIKRINDEN GECELER YATABILMIREM BU FIKRI BASIMDAN ATABILMIREM NEYLEYIMKI SENE CATA BILMIREM AYRILIK AYRILIK AYRILIK...  \r\n \r\n  \r\nUNUTMAK ZOR ANLATMAKSA IMKANSIZ CUNKU SEN UNUTTUKCA HATIRLANAN VEDE ANLATTIKCA BITMEYENSIN. BITANEM. SENI SEVIYORUM...  \r\n \r\n  \r\nDUNYA BIR EFSANE HAYAT BIR DRAM YASAM BIR HUZUN SEVMEK BIR HATA...  \r\n \r\n  \r\nUMUDA KURSUN SIKSADA OLUM, UNUTMA UMUDA KURSUN ISLEMEZ...  \r\n \r\n  \r\nDON CAREM EL GIBI UZAK DURMA DOKUNUR GURURUMA BU YABANCI HALLERIN...  \r\n \r\n  \r\nBELKI ANLAMADIGIM BI HIS,BELKI SANA KIZAMADIGIMIN BELGESI, BELKIDE SAMIMIYETI YANLIS ZAMANDA YANLIS INSANDA ARAMANIN CARESIZ ANLATILISI IDI...  \r\n \r\n  \r\nSENI BIRAKIYORUM BIR ELVEDA BILE DIYEMEDEN, SENI SEVIYORUM, SENI BILE GOREMEDEN...  \r\n \r\n  \r\nNEZAMAN SAGIR BIR RESSAM KIRISTAL BIR ZEMIN UZERINE DUSEN GULUN CIKARDIGI SESIN RESMINI YAPARSA ISTE O ZAMAN BEN SENDEN VAZGECERIM...  \r\n \r\n  \r\nSENSIZ KALDIGIM ILK GUNDEN BERI ICIMDE BIR UMUT VUSLATA DAIR. AKSAMLARI IMZALADIM GOZYASLARIMLA.SENI ARAMIYOR SENI SORMUYORSAM BUM SENDEN VAZGECTIM DEMEK DEGILDIR BIRDAHA BOYLE SEVECEK OLSAM BIR KALEMDE SILERDIM SENI...  \r\n \r\n  \r\nSENSIZLIK HAYAT DENEN DEFTERIN ZINDAN KARASI YAPRAKLARINA HASRET KIRMIZISIYLA MULTECI HUZUNLER YAZMAK GIB ASKIMM...  \r\n \r\n  \r\nYAZDIGIM HER CUMLE AGLIYOR.  \r\n \r\n  \r\nACIYI HISSETMIYORUM. SEVMEYI BECEREMIYORUM. CARESIZLIK HIC BITMEYEN BIR SENFONI SENSIZ...  \r\n \r\n  \r\nHAYATTA 4 YANLIS YAPTIM DOGMAK YASAMAK BUYUMEK VE UMUTLARA SARILMAK 1 TEK DOGRU YAPTIM O DA SENI SEVMEK AMA UNUTMUSUM GUZELIM 4 YANLIS 1 DOGRUYU GOTURDU.  \r\n \r\n  \r\nGERCEK GULUSLER SANA SANA UMUTLAR, MUTLULUKLAR SANA. SANA YAZ,SANA BAHAR RENGARENK CICEKLER BANA YALNIZLIK, KIS, KAR VE SAHTE GULUSLER YETER !..  \r\n \r\n  \r\nNASILKI SENSIZLIGI BEN YARATMADIYSAM YASAYACAGIN BENSIZLIKTE BENIM ESERIM OLMAYACAK UZULME UZULURSEN YILLARIN SENDEN ALACAGI TEK SEY GENCLIGIN OLACAKTIR...  \r\n \r\n  \r\nBIR KARANLIK GELIYOR YOKLUGUNUN ARDINDAN. NE ZAMAN GUNE$ BATSA BU SON GECEM DIYORUM. VAZGEC YALAN DUNYANIN KOHNE SALTANATINDAN. YETI$IR BUNCA KEDER BUNCA ELEM DIYORUM. BU NE BITMEZ AYRILIK, BU NE BITMEZ OZLEM DIYORUM.  \r\n \r\n  \r\nBEN SENI BIR NOKTADAN GECEN DOGRULAR KADAR SEVDIM,SEN BENI IKI NOKTADAN GECEN DOGRU KADAR ANLADIN...  \r\n \r\n  \r\nASK KARSINDAKINI BULUNMAZ HINT KUMASI SANMAKLA HIYARIN TEKI OLDUGUNU ANLAMAN ARASINDAKI ZAMANDIR.  \r\n \r\n  \r\nHADI GIT BIRAK BENI ESKI KISIMDA YARINLARIMI ALDA GIT OMRUM BOYUNCA YASIYACAGIM UNUTULUSLARI, HUZUNLERIVE OLUMLERI BIRAK VE GIT..  \r\n \r\n  \r\nRUZGAR OZUR DILESEDE DAL KIRILDI BIR KERE...  \r\n \r\n  \r\nSEN SOZLERIME ALDIRMA,GOZLERIN ZAMANSIZ ISLANMASIN,GUNESIN NERDEN DOGDUGUNU BILIRSIN VE SENI NASIL SEVDIGIMI DE BILIRSIN EGER BITSIN DIYORSAR YINEDE SEN BILIRSIN..!  \r\n \r\n  \r\nSENIN YOKLUGUN CEHENNEMIN OBUR ADI NE OLUR GITME USUYORUM...  \r\n \r\n  \r\nHAYAT HICBIR INSAN ICIN AGLAMAYA DEGMEZ.ZATEN DEGEN INSAN AGLATMAZ.YINE DE AGLAMAK ISTIYORSAN,BASINI DIK TUT KI GOZYASLARIN AGLATAN KADAR ALCALMASIN.SANA SEVGIMI SOYLESEM SEVGIMDEN KORKARSIN.BEN SENIN ICIN OLMASAM BILE SEN BENIM ICIN HEP VARSIN...  \r\n \r\n  \r\nBIR COCUK GULUSUNDE, RUZGARIN EN CAPKIN OPUSUNDE, YAGMURUN HER SACINA DUSUSUNDE BENI HATIRLA....  \r\n \r\n  \r\nEGER BENI BU SOKAKTA, BU MAHALLEDE, BU SEHIRDE BULAMAZSAN,SEVGILIM BILKI BEN, GOZLERININ DALDIGI YERDEYIM.  \r\n \r\n  \r\nBASKALARINA KENDINDEN FAZLA DEGER VERME.YA ONU KAYBEDERSIN, YA DA KENDINI MAHVEDERSIN.  \r\n \r\n  \r\nSEVME BENI, HATIRLA.OZLEME BENI AMA UNUTMA.  \r\n \r\n  \r\nSEHRIMIN BENSIZ SOKAKLARINI ADIMLARKEN,BEN SENSIZLIGIMIN SOKAKLARINDA BIR SEHIR KURUYORUM KENDIME.  \r\n \r\n  \r\nSEN BENIM OLMADIN HICBIR ZAMAN, BEN SENINIM AMA DAIMA.SENDEKI YOKLUGUM YOK EDEMEDI BENDEKI VARLIGINI.YUREGIM SEVGI, YUREGIM OZLEM DOLU.  \r\n \r\n  \r\nGUNES BATMADAN YILDIZLAR GORUNMEZ ELBET,GELECEK GUNLSER NE ALIR NE VERIR BILEMEM,BILDIGIM SARKILAR BITEN ASKLARIN CENAZE TORENLERIDIR.BIR SARKI SOYLE GOM GITSIN,GOM GITSIN YALANLARI GOM GITSIN YALNIZLIGI,GOM GITSIN ACILARI.SONRADA OTUR YUREGIN YESERENE KADAR \r\n \r\n  HANI GITMEYECEKTIN HEP BENI SEVECEKTIN O KELIMEYI SOYLEMEYECEKTIN ELVEDA DEMEYECEKTIN HANI OLUMLE AYRILACAKTIN HEP YANIMDA OLACAKTIN SENDE BOYLEMI YAPACAKTIN BANA SENSIZLIGI YASATACAKTIN HANI COK SEVIYORDUN ASLA AYRILMAM DIYORDUN NEDEN SIMDI GIDIYORSUN \r\n \r\n  \r\nGOZLERIMDE, GOZLERINI , GORMIYOSA , GOZLERIN, BILKI EYY! SEVDIGIM O GOZLER ISTE O ZAMAN ELLERIN...  \r\n \r\n  \r\nALISKIN DEGILIM SENSIZ KALMAYA BU AYRILIGA, SESIN SOLUGUN OLMAYINCA DOGMUYOR GUNES DUNYAMA, SONSUZA KADAR BUNU SAKIN UNUTMA...  \r\n \r\n  \r\nHAYKIRSAM DUNYAYA ASKIMI BIR SOLUKTA, SENDEMI CEKIP GITTIN BUNU BEN HAK ETMEDIM HANI &quot;SENSIZ BIR HICIM&quot; DEMISTINYA..?  \r\n \r\n  \r\nBELKIDE DILINDEN BU SARKI DUSMEZ,DILIN SOYLESEDE GONLUN HISSETMEZ,BILSEN BILE BENIM ICIN FARKETMEZ BIRTEK DILEGIM VAR BETER OL YETER...  \r\n \r\n  \r\nBENI AVUTACAK ANILARIM VAR, SENI YASATACAK SONSUZA KADAR, YOLUN ACIK OLSUN VERDIYSEN KARAR YUREGININ GOTURDUGU YERE GIT..  \r\n \r\n  \r\nDEMEK HIC SEVMEMIS OZLEMISSIN BENI UNUTMUS DUSUNMEMISSIN BENI. SAHTE DUYGULARLA YALAN DUYGULARLA BIRAKIP GITMISSIN BENI...  \r\n \r\n  \r\nSENI SEVIYORDUM BILIYORSUN ASKIN BITTI DEMEK GIDIYORSUN BANA BOYLEMI VEDA EDIYORSUN??  \r\n \r\n  \r\nASKINDAN HATIRA NE VARSA BENDE ISMINLE BERABER GOMDUM MAZIYE ARTIK HAYAT BANA ZOR OLSA BILE BUNDAN SONRA ARTIK NEFRETIMSIN SEN...  \r\n \r\n  \r\nOLUMUNE SEVEN BENDIM HAYATIMI VEREN BENDIM DEGERIMI SEN BILMEDIN ASKIMA IHANETIN ANSIZIN CEKIP GIDEN SENDIN SEN BANA YANLIS YAPTIN..!  \r\n \r\n  \r\nDONMESIN KALBIMDE BIR YER BULAMAZ ZANNETMESIN BASKA SEVEN BULUNMAZ, SANMASIN BU HAYAT ONSUZ YASANMAZ NE OLUR ONU HIC HATIRLATMAYIN..!  \r\n \r\n  \r\nZAMAN GELIR INSAN GULERKEN AGLARMIS GOZ YASLARI SEL OLUP AKARMIS KAH KAHA BIR MASKEDIR BILIRMISIN INSAN SEVDIGINDEN AYRILINCA BU MASKEYI TAKARMIS  \r\n \r\n  \r\nAYRILIK AKLIMDAN GECMIYOR INAN HEDEFIN TEK SENSIN GERISI YALAN OK YAYDAN FIRLAMIS EY BENIM BELAM DONERSEM SOZUMDEN NAMERDIM VAR OLDUR BENI.OL DE OLEYIM!!!  \r\n \r\n  \r\nSIMDIK GOZLERIME AGLAMAYI OGRETTIM KI, BU YASLAR UTANGAC BOYNUNUN KOLESI OLSUN. BU DA BENIM SANA AYRILIRKEN HEDIYEM OLSUN!  \r\n \r\n  \r\nOZUR DILERIM SENI SEVDIGIM ICIN, OZUR DILERIM GOZLERINE BAKTIGIM ICIN, OZUR DILERIM SENI HEP ARADIGIM ICIN, COK AMA COK OZUR DILERIM SENI INSAN SANDIGIM ICIN!  \r\n \r\n  \r\nBU BENIM SEVDAM KURSUNLARA DIZILMIS, BU BENIM SEVDAM IHANET YUKLU SEVGILERDEN VURGUN YEMIS, FAKAT OLMEMIS!!!  \r\n \r\n  \r\nBIR NASIHATIM VAR SANA KENDINI INSAN YERINE KOYMA EGER BIR GUN CIKARSAN KARSIMA SEVGIM DEGIL KURSUNUM DEGER ANLINA!  \r\n \r\n  \r\nALLAHIM BIKTIM ARTIK,ISYANIM SANA DEGIL KENDIME, NAPACAGIMI BILEMIYORUM, HER GECEN GUN VE GECE DAHA COK OLUYORUM BU ASK BENI MAHVEDIYOR KURTULMAK ISTIYORUM...  \r\n \r\n  \r\nGOZYASLARIYLA YIKANMIS YUZ DUNYANIN EN TEMIZ YUZUDUR ISTE BENIM YUZUMDE EN TEMIZ YUZ CUNKI HERGUN YIKIYORUM...  \r\n \r\n  \r\nGUNES AVUCLARINDA BIR SABAH UYANDIGINDA USUYORSAN, KALABALIKTA YALNIZ HISSEDIYORSAN KENDINI VE BIR ANLIK KIRILMISSA YUREGIN: BENI HATIRLA!  \r\n \r\n  \r\nBIR RUYA GIBI OLDU ARTIK YASADIKLARIM. NE SEVENIM KALDI, NEDE ESKI ASKLARIM. GECMELI ARTIK GECELERCE AGLAMALARIM. ELVEDA SEVGILIM ELVEDA ASKIM!!  \r\n \r\n  \r\n...OYSA, OLMAYCAK KADAR ZOR DEGILDI BAZEN GEL DEMISTIM HEP KAL ANLADIN ...VE GITTIN TABII KI.  \r\n \r\n  \r\nISTESEM BEN BU OMRU, BU TALIHI ISTEMEM BOYLE DURUP DURUP SENDEN AYRILMAK VARSA ORADA BIR MEZAR KAZILIR BENIM ICIN AYRILIGIN NEREDE BASLARSA.  \r\n \r\n  \r\nMESAFELERIN AYRILIK OLDUGUNU SOYLERLER HEP, OYSA AYRILAN BEDENLERDIR YUREKLERSE HEP BERABERDIR, BIR SEYLERI PAYLASMAK ICIN BEDENIMLE OLMASADA YUREGIMLE YANINDAYIM....  \r\n \r\n  \r\nHAYATTA HIC KIMSENIN BILMEDIGI ENGIN DENIZLERDE, YUNUSLAR GIBI YUZMEKTIR SENI SEVMEK UMITLERIM VARDI TESBIH MISALI SEN GIDERKEN DAGILIVERDILER BIRDEN...  \r\n \r\n  \r\nYOO, AGLAMAK YOK KUCUK KIZ...HANI SOZ VERMISTIN AGLAMAK YOK DIYE. BAK GOZLERIN DOLMAYA BASLADI.. SEN ALISMAMIS MIYDIN AYRILIKLARA? HADI DON SIRTINI DUNYA''YA ARKANA BAKMADAN CEK GIT! ELVEDA DEME DOSTLARINA...SADECE &quot;BELKI&quot; DE YASLI GOZLERLE &quot;BELKI&quot;....!''''  \r\n \r\n  \r\nHER HATIRLAYIS EVVELINDE UNUTMAYI SAKLAR BILIR MISIN? VE BILIR MISIN BEN SENI BIR DEM OLSUN UNUTMADIM!  \r\n \r\n  \r\nYAPRAKLAR DOKULUR,GULLER SOLABILIR,SENI HERKES UNUTABILIR,BEN ASLA!  \r\n \r\n  \r\nBANA HAYATIMDA HIC GULMEDIM KI BUNDAN SONRA NE BEKLEYECEGIM KI YALVARACAGIM TANRIYA AL BENI DE YANINA SENSIZLIGE ALISMAK ZOR GELECEK BANA...  \r\n \r\n  \r\nYAKAMOZLU GECELER BENIM GECEM...CUNKU ASIK OLDUGUMU YAKAMOZLU GECELERDE HAYKIRIYORUM...TEK BASIMA LIMANDA DENIZE KARSI..SENDE DUY ASKIM....  \r\n \r\n  \r\nBU SEHIR ,BU KALABALIK ,BU KARMASA. ICIM BURKULUYOR , ONCA INSAN BIR SEN OLMUYOR. VE SEN ONCA INSANDAN BIRI OLMUYORSUN...  \r\n \r\n  \r\nGOZLERINI KAPAT EN BUYUK HAYALLERINI DUSUN.SONRADA HEPSININ GERCEKLESTIGINI... O ZAMAN ANLARSIN SENIN ICIN NELER DUSUNDUGUMU...  \r\n \r\n  \r\nKOLAYMI AYRILMAK CANIMA CAN OLMUSSUN ASKININ ESIRIYIM HERSEYIM SEN OLMUSSUN...  \r\n \r\n  \r\nHADI GIT ARTIK,NE DURUYORSUN BEEE YOKLUGUNA INANDIR BENI YORULDUM HER BULDUGUM YERDE KAYBETMEKTEN SENI...');
INSERT INTO `phpbb_posts_text` VALUES (414, '19f29b7321', 'Dogum Gunu', 'HATIRLARMISIN DOGDUGUN GUNU... SEN AGLARKEN HERKES GULUYORDU. OYLE BIR OMUR YASAKI OLDUGUNDE HERKES AGLASIN, SEN MUTLULUKLA GULUMSE. IYIKI DOGDUN...  \r\n \r\n  \r\nBUGUN BELKI DE COK KISIDEN DOGUMGUNU MESAJI ALACAKSIN, ANCAK SU AN OKUDUGUNEN FARKLISI CUNKU TUMUYLE SEVGIYLE YAZILMIS BIR MESAJ. IYI KI VARSIN...  \r\n \r\n  \r\n160 KISA KARAKTERE NELER SIGDIRABILIRIM DIYE DUSUNUYORUM ANCAK AKLIMA MUTLU BIR YAS VE SEVGI DOLU NICE YILLAR DILEMEKTEN BASKA BIR SEY GELMIYOR. SENI SEVIYORUM.  \r\n \r\n  \r\nSESIM GUZEL OLMADIGI ICIN SANA BIR DOGUMGUNU SARKISI SOYLEYEMIYORUM. BU YUZDENDIR KI BOYLE KISA BIR MESAJ CEKIYORUM. MUTLU YILLAR!  \r\n \r\n  \r\nHMMMM BU MESAJI NEDEN CEKIYORUM, UNUTTUM, INAN HIC HATIRLAMIYORUM. DUR BAKAYIM.. DUR DUR BULDUM :) DOGUMGUNUN KUTLU OLSUN!...  \r\n \r\n  \r\nDILEGIM BUGUN DILEDIGIN TUM DILEKLERIN GERCEK OLMASI. BELKI YANINDA DEGILIM AMA BIL KI KALBIMIN EN DERIN YERINDE BUGUNU SENINLE KUTLUYORUM. NICE YASLARA...  \r\n \r\n  \r\nBUGUN DOGUMGUNUN OLDUGU ICIN FARKLI VE OZEL OLDUGUNU MU SANIYORSUN SEN? OYSA SEN BENIM ICIN SADECE BUGUN DEGIL HER GUN FARKLI VE OZELSIN. IYI KI VARSIN...  \r\n \r\n  \r\nDOGDUGUN GUN BULUTLARI YIRTARAK, BIR GUNES GIBI ETRAFINA AYDINLIK SACARAK GIRDIN HAYATA. HEP SEVGIYLE YASA! NICE YASLARA...  \r\n \r\n  \r\nGELECEGINI OLUSTURACAK HER YENI GUNUN BIR ONCEKI GUNDEN DAHA GUZEL, ISTEKLERINE UYGUN VE SENI MUTLU EDECEK SEKILDE OLMASINI DILERIM. NICE SENELER...  \r\n \r\n  \r\nDILERIM YENI YASINDA MUTLULUKLARIN EN GUZELINI YASAR, BASARI MERDIVENLERINI TIRMANIRSIN VE DILERIM YUZUN HEP GULER, NESENI HIC YITIRMEZSIN. DOGUMGUNUN KUTLU OLSUN!  \r\n \r\n  \r\nDUNYADA ESSIZ BIR GUZELLIK VARSA O DA KALBINDEDIR. HAYATININ BUNDAN SONRASI KALBININ GUZELLIGI GIBI GECSIN. IYI KI VARSIN VE IYI KI DOGDUN!  \r\n \r\n  \r\nYASA . SEV . GUL! BUNLAR EKSIK OLMASIN YASAMINDA. YASIN KAC OLURSA OLSUN HER SEYIN EN GUZELI SENINLE OLSUN. NICE MUTLU, NESELI VE YASAM DOLU YASLARA...  \r\n \r\n  \r\nBUGUN BIR YASINI DAHA DOLDURMANIN MUTLULUGUNU YASARKEN GELECEGIN SANA KALBINDEKI TUM DILEKLERI VERMESINI DILIYORUM. DOGUMGUNUN KUTLU OLSUN.  \r\n \r\n  \r\nFLUUUPPP! BU BIR SMS SURPRIZI. SANA SANS GETIRMEK ICIN BURADA. BU YUZDEN HEMEN GOZLERINI KAPAT VE BIR SEY DILE. MUTLU YILLAR SANA, MUTLU YILLAR SANA.  \r\n \r\n  \r\nKISA BIR MESAJ OLMALI BU. SANA BINLERCE OPUCUK VE SEVGI YOLLUYORUM BURADAN.. BIL KI UNUTULMADIN.. DOGUMGUNUN KUTLU OLSUN!  \r\n \r\n  \r\nARKADASLAR YILDIZLAR GIBIDIR, ONLARI HER ZAMAN GOREMEZSIN AMA SENIN ICIN HER DAIM VAROLDUKLARINI VE SENI DUSUNDUKLERINI BILIRSIN. BUGUN BENI GOREMEZSEN DE BIL KI YANINDAYIM! DOGUMGUNUN KUTLU OLSUN... IYI KI VARSIN VARSIN.. BIRLIKTE DAHA NICE YASLARA...  \r\n \r\n  \r\nDIKKAT! BU MESAJ SEVGI, NESE VE IYI DILEK ICERMEKTEDIR. BIR DAKIKA ICIN YASAMIN VE SENI DUSUNEN BIRININ OLDUGUNUN SEVINCINI HISSET VE MUTLU OL! BU MUTLULUGUN HER ZAMAN SURSUN. IYI KI DOGDUN. NICE MUTLU YASLARA...  \r\n \r\n  \r\nDILERIM YENI YASINDA MUTLULUKLARIN EN GUZELINI YASAR, BASARI MERDIVENLERINI RAHATLIKLA TIRMANIRSIN VE DILERIM YUZUN HEP GULER, NESENI HIC YITIRMEZSIN. SEVGI DOLU KALMAN VE MUTLU OLMAN DILEGIYLE... DOGUMGUNUN KUTLU OLSUN!  \r\n \r\n  \r\nBIRAZ SANS, BIRAZ SEVGI VE SABIR, BIRER PARCA ZAMAN, BASARI VE MEMNUNIYETI DE EKLERSEK MALZEMELERE, HEPSINI KARISTIRIP SENIN ICIN UZUN VE DILEKLERININ GERCEKLESTIGI BIR &quot;HAYAT PASTASI&quot; YAPABILIRIZ SANIRIM... NICE YASLARA!  \r\n \r\n  \r\nBIR YIL DAHA BITTI, AMA SAKIN UZULME ZAMAN CABUK GECIYOR DIYE... UNUTMA KI HERKES AYNI SEYI YASIYOR. BU YILIN SONUNDA GERIYE BAKTIGINDA UMARIM &quot;HARIKA BIR YILDI&quot; DERSIN.. TUM DILEKLERININ GERCEKLESMESI DILEGIMLE.. NICE YILLARA...  \r\n \r\n  \r\n365 SAYFALIK BIR OYKU DAHA BASLIYOR, HER GUNE BIR YAPRAK SAKLA, HER YAPRAGA BIR OYKU SIGDIR MUTLULUK DE ADINA. NICE GUZEL OYKULER SENIN OLSUN. IYI KI DOGDUN.  \r\n \r\n  \r\nGUNES KADAR SICAK, KARTANESI KADAR BERRAK, YAGMUR KADAR SAF VE TEMIZ BIR OMUR DILEGIYLE');
INSERT INTO `phpbb_posts_text` VALUES (415, 'd2c6340ebc', 'Komik', 'ICME ASK SARABINDAN ACIDIR AMAN DIKKAT ET KIZIM BABASI HOCADIR.  \r\n \r\n  \r\nDUNYADA IBNELIK OLMASAYDI DUNYA YUVARLAK OLMAZDI...  \r\n \r\n  \r\nBUTUN BISIKLETLERE BINDIM, BISAN A BINEMEDIM...  \r\n \r\n  \r\nAH KIZIM AH!! BEN NE SALAGIM. SENI NE DOKTORLAR, NE MUHENDISLER ISTEDI DE VERMEDIM. UZULME ANNECIGIM. BEN HEPSINE VERDIM...  \r\n \r\n  \r\nTEMEL ILE DURSUN TRABZONDA KAZI YAPIYORLARMIS. KAZ OLMUS...  \r\n \r\n  \r\nOGLUM MUJDE SANA IS BULDUM! NASIL IS,BUFEDE YEDIGUN VERECEKSIN...  \r\n \r\n  \r\nSENI GORUNCE GOZLERIM DOLAR, KULAKLARIM MARK...  \r\n \r\n  \r\nBU MESAJ OZEL BI FREKANSLA GONDERILMISTIR.ZEKILERDE HAFIZA KAYBI APTALLARDA KISA SURELI KORLUK IBNELERDEDE BI ANLIK GULUMSEME YAPAR...  \r\n \r\n  \r\nASK HAVUZUNA APTALLAR DUSER, AMA BENI ITTILER...  \r\n \r\n  \r\nAGLARSA ANAM AGLAR GERISI PLAYBACK YAPAR...  \r\n \r\n  \r\nO''NUN SERT BEDENINI OCE AVCUMUN ICINE ALDIM SONRA KAFASINI DUDAKLARIMIN ARASINDAN GECIRDIM O ESSIZ SIVI BANA HAYAT VERIYORDU COCACOLA HAYATIN TADI...  \r\n \r\n  \r\nBOYNUMA SURTEREK GOGUSLERININ ARASINDAN ASAGIYA KALCAMIN YANINA KADAR GETIRIP YUVASINA OTURTTUM CIKAN SLAK SESI BANA GUVEN VERIYORDU EMNIYET KEMERI SEN DE TAK...  \r\n \r\n  \r\nIKI UZAYLI BENZIN ISTASYONUNA GITMISLER.BIRI BENZIN POMPASINI TUTMUS ARKASINA SOKMUS.DIGERI ONA SASKIN BIR BAKISLA:BU YAPTIGIN NORMALMI?DEMIS. DIGERI ISE:HAYIR KURSUNSUZ.DEMIS ...  \r\n \r\n  \r\nTEMEL KAZI YAPINCA FADIME HASRETLIKTEN CATLAMIS...  \r\n \r\n  \r\nDOGA''NIN KANUNU VARSA ARIF SAG''IN SAZI VAR...  \r\n \r\n  \r\nADAMIN BIRI MAHKEMENIN ONUNDEN GECIYORMUS. MAHKEMEDEN CATAL-KASIK SESLERI GELIYORMUS NIYE? CUNKU MAHKEMEDE SANIGIN HAKKINI YIYOLARMIS...  \r\n \r\n  \r\nOLM SENDE NE DERS CALISIYON,CEK KOPYANIN HASINI, CEKME KARNE YASINI...  \r\n \r\n  \r\nYAG BAKKALDA, UN CUVALDA, SEVGILIN SON DURAKTA...  \r\n \r\n  \r\nKARIN OLMAK ISTIYORUM KARIN, EY BENIM KARDAN ADAMIM...  \r\n \r\n  \r\nDOKTORUM SIGARADAN UZAK DURMAMI SOYLEDI, BEN DE BIR METRELIK BI AGIZLIK YAPTIRDIM...  \r\n \r\n  \r\nBIR KAZAN VARMIS. BU KAZAN COK IYI DANS EDIYORMUS. ACAIP ORYANTAL YAPIYORMUS. MUHTESEM KIVIRIYORMUS. BU KAZANA NE DENIR? IYI OYNAYAN KAZANSIN...  \r\n \r\n  \r\nKUSURA BAKMA BIRADER, SENI BIRINE BENZETTIM.OLABILIR, BABAM COK GEZERMIS...  \r\n \r\n  \r\nABI BI SEN BAYARSIN BI DE CELAL BAYAR...  \r\n \r\n  \r\nSEN TERLEMISSINDIR, SANA TERLIK GETIRIYIM...  \r\n \r\n  \r\nZORLA GUZELLIK OLMAZ, ESTETIKLE OLUR...  \r\n \r\n  \r\nDUN EVDE CANIM SIKILDI ,KAFAMA GORE TAKILAYIM DEDIM. TAMIRCIYE GIRMISIM. BIRAZ KAFAM BOZUKTU DA...  \r\n \r\n  \r\nBIZIM BIR TANIDIK VARDI,PARAYA PARA DEMEZDI, CUNKU &quot;R&quot; LERI SOYLEYEMEZDI...  \r\n \r\n  \r\nBEN BIR COCUK, SEN BIR COCUK, YAPTIK BIR COCUKLUK, OLDUK UC COCUK...  \r\n \r\n  \r\nERKEKLER PARK YERI GIBIDIR. IYILERIN KEPSI KAPILMISTIR...  \r\n \r\n  \r\nBEBEGINIZIN ALTINA YAPMASINI ISTEMIYORSANIZ CEVIRIN USTUNE YAPSIN...  \r\n \r\n  \r\nSOL KULAGINI KAPATIRSAN SAG DUYULU OLURSUN...  \r\n \r\n  \r\nHICBIR ONYARGIM YOK. BUTUN INSANLARDAN NEFRET EDIYORUM, O KADAR...  \r\n \r\n  \r\nERKEKLER HEP TANRI ONCE BIZI YARATTI DIYE OVUNURLER. AMA BU GAYET NORMALDIR. CUNKU HER SANATCI ESERINI YARATMADAN ONCE BIR MUSVETTESINI YAPAR...  \r\n \r\n  \r\nBABAMA DEGERIMI SORDUM &quot;DUNYALAR KADAR&quot; DEDI, DUNYANIN DEGERINI SORDUM &quot;BES PARA ETMEZ&quot; DEDI.  \r\n \r\n  \r\nBENDE SEYTAN TUYU YOK, EPULASYONLA ALDIRDIM.  \r\n \r\n  \r\nBU TUP BEBEK HATALI: SUREKLI GAZ KACIRIYOR.  \r\n \r\n  \r\nGENCLIGIM ACI VERIYORDU , AMELIYATLA ALDIRDIM....  \r\n \r\n  \r\nOYLE YALNIZDI KI TOPLU MEZARLIGA GOMULMEYI VASIYET ETTI.  \r\n \r\n  \r\nTARIHTE 16 DEVLET KURMUS VE 15 DEVLET BATIRMIS BIR MILLETIZ...  \r\n \r\n  \r\nSIZE YAPILMASINI ISTEMEDIGINIZ SEYI BASKALARINA YAPIN...COK ZEVKLI OLUYOR  \r\n \r\n  \r\nKARIMI O KADAR SEVIYORUM KI ESKIMESIN DIYE BASKALARININ KARILARINI KULLANIYORUM');
