INSERT INTO `phpbb_posts_text` VALUES (521, '2f12abc359', 'Babam ve Oglum Burda Gösterimde:)', 'Merhaba arkadaslar  \r\n\r\nSu siralar cok konusulan bir film babam ve oglum \r\n\r\nBurda Gosterimde !!! :) \r\n\r\nCok duygusal bir film ldugunu duydum ama aglamak yok :P \r\n\r\n[img:2f12abc359]http://www.ntvmsnbc.com/news/212665.jpg[/img:2f12abc359]\r\n \r\nFilmin Konusu\r\n\r\n\r\n1980 darbesinde annesini kaybeden küçük Deniz (babasý o dönemde bir çok erkek çocuða verilen ismi koymuþ) yedi yýl sonra hiç görmediði dedesinin Ege''deki çiftliðine doðru bir yolculuða çýkar. Deniz''in dedesini hiç görmemesinin nedeni dedesiyle babasýnýn yýllardýr küs oluþudur.\r\n\r\nHüseyin Efendi (Çetin Tekindor) okumaya diye gönderdiði oðlunun politik olaylara karýþtýðýný öðrenince onu evlatlýktan silmiþtir çünkü. Sadýk''ýn her þeye raðmen baba evine geri dönüþünün nedeni Deniz''den ayrýlmak zorunda oluþudur; küçük oðlunu babasýna emanet edecektir. Kelimenin tam anlamýyla Deniz bu çiftlikte hafif tatlý kaçýk bir ailenin ortasýnda bulur kendini. Evin yanaþmalarý, küs teyze, traktör kullanan ve telsizle konuþan müthiþ bir babaanne, bileðinden boðazýna kadar bilezikle dolaþan gelin Hanife ve saf bir amca. Hepsi baðýrarak ve hep bir aðýzdan konuþuyor. Sadýk Uðruna savaþtýðý bir Türkiye''ye ve terk ettiði sevgilisiyle ve kendiyle kasabada yüzleþirken; çocuk, dedesinin ve babasýnýn arasýndaki tüm buzlarý eritecektir');
