INSERT INTO `phpbb_posts_text` VALUES (527, '242fe4ab0c', '!4 Yasindaki Genc Cocuk', '14 Yasindaki Utrecht de kalan genc cocuk, son noktayida dostu buldurdugundan dolayi, kendisine olumu tercih etti.\r\n\r\naile icerisinde, ve okulda sorunlar yasadigindan dolayi, hayatta kuskun birisiydi\r\n\r\nyinede cok sevdigi bir oyun, Runescape, oynuyarak, vede o oyunun forum yerinde baskalariyla oyununu paylasarak, bir sekilde azaltiyordu, dertlerini\r\n\r\nCok sevdigi bir dostu, bunun runescape oyundaki uyeligini hackerleyince, cok sinirinden, vede hayatta tamamen son vermek icin, son kez bir mail gondermisti, runescape forum sitesine.\r\nSonunda ise, kendisini asmak ile hayatina son noktayi koymustu\r\n\r\n[color=red:242fe4ab0c][b:242fe4ab0c][url=http://images.fok.nl/upload/060228_50242_afscheidsbriefgamerbunnik.jpg]Burdan o Yollanilmis olan Son Maili Okuyabilirsiniz[/url][/b:242fe4ab0c][/color:242fe4ab0c]');
